INSERT INTO `contenidos` VALUES("8", "<p>En 1964 en la provincia de C&oacute;rdoba, el Sr. Alfredo Luis CARLOS Gatti, funda una peque&ntilde;a empresa dedicada a la reparaci&oacute;n de motores el&eacute;ctricos y a la fabricaci&oacute;n de tableros de uso industrial. Al principio de los setenta, Electromec&aacute;nica Gatti comienza la fabricaci&oacute;n de maquinas de soldar, las cuales tuvieron una excelente aceptaci&oacute;n, imponi&eacute;ndose en el mercado r&aacute;pidamente.<br />\n<br />\nEn 1975, el desarrollo tecnol&oacute;gico y comercial de la empresa la coloca en una posici&oacute;n de liderazgo en el mercado, y agrega a la ya conocida l&iacute;nea de productos la fabricaci&oacute;n de equipos industriales, comerciales y dom&eacute;sticos para el movimiento del aire. Los altos niveles de desempe&ntilde;o, su est&aacute;tica, performance y excelente relaci&oacute;n calidad/precio, han ubicado a GATTI S.A, como la primera en ventas en el mercado Nacional, y le han permitido posicionarse en el mercado externo, compitiendo con productos de tecnolog&iacute;a y calidad internacional.<br />\n<br />\nLa producci&oacute;n se lleva a cabo en 4 plantas que totalizan los 5500 m2 cubiertos, contando con maquinaria y tecnolog&iacute;a de &uacute;ltima generaci&oacute;n, desde el momento de dise&ntilde;o del producto hasta su control final, pasando por las pruebas m&aacute;s exigentes de calidad. Cuenta con un Laboratorio de Ensayos, siendo este uno de los pocos existentes en Latino Am&eacute;rica, fabricado bajo las normas IRAM 19004, cuyas mediciones dan como resultado curvas exactas de performance de producto. Su personal permanentemente capacitado trabaja incansablemente para desarrollar alternativas de producto, m&eacute;todos de producci&oacute;n y estrategias de administraci&oacute;n y marketing para lograr la constante adaptaci&oacute;n a las exigencias de sus clientes.<br />\n<br />\nEn el mercado Argentino los productos se distribuyen a trav&eacute;s de la casa central, y de sus sucursales en los puntos m&aacute;s importantes del pa&iacute;s, como Buenos Aires, C&oacute;rdoba y Rosario, complement&aacute;ndose con una amplia red de revendedores en todo el pa&iacute;s. Actualmente la empresa exporta a gran cantidad de pa&iacute;ses dentro del continente Americano, presentando sus 20 l&iacute;neas de productos y m&aacute;s de 2500 art&iacute;culos diferentes, a los cuales se suman productos dise&ntilde;ados espec&iacute;ficamente de acuerdo a necesidades espec&iacute;ficas de los clientes. Todas estas cualidades hacen de esta empresa una fuente de constante crecimiento y orgullo no solo para sus due&ntilde;os, sino para el pa&iacute;s.</p>\n\n<p><strong>CASA CENTRAL</strong></p>\n\n<div class=\"btgrid\">\n<div class=\"row row-1\">\n<div class=\"col col-md-4\">\n<div class=\"content\">\n<p><strong><a data-lightbox=\"ar1voqqtcg\" data-lightbox-saved=\"\" href=\"http://gattisa.com.ar/archivos/image/1.jpg\"><img alt=\"GATTI\" src=\"http://gattisa.com.ar/archivos/image/1.jpg\" style=\"width:100%\" /></a></strong></p>\n</div>\n</div>\n\n<div class=\"col col-md-4\">\n<div class=\"content\">\n<p><strong><a data-lightbox=\"z2sk6iuun9\" data-lightbox-saved=\"\" href=\"http://gattisa.com.ar/archivos/image/2.jpg\"><img alt=\"GATTI\" src=\"http://gattisa.com.ar/archivos/image/2.jpg\" style=\"width:100%\" /></a></strong></p>\n</div>\n</div>\n\n<div class=\"col col-md-4\">\n<div class=\"content\">\n<p><strong><a data-lightbox=\"z2sk6iuun91\" data-lightbox-saved=\"\" href=\"http://gattisa.com.ar/archivos/image/3.jpg\"><img alt=\"GATTI\" src=\"http://gattisa.com.ar/archivos/image/3.jpg\" style=\"width:100%\" /></a></strong></p>\n</div>\n</div>\n</div>\n\n<div class=\"row row-2\">\n<div class=\"col col-md-4\">\n<div class=\"content\">\n<p><strong><a data-lightbox=\"z2sk6iuun92\" data-lightbox-saved=\"\" href=\"http://gattisa.com.ar/archivos/image/4.jpg\"><img alt=\"GATTI\" src=\"http://gattisa.com.ar/arc