INSERT INTO `contenidos` VALUES("18", "<span style=\"font-size:13px\">El aire es soplado o aspirado a través de un conducto equipado con rejillas estabilizadoras al comienzo para garantizar que el flujo se comporte de manera laminar o con obstáculos u otros objetos si se desea que se comporte de forma turbulenta. Los modelos se montan para su estudio en un equipo llamado balanza a la cual están adosados los sensores que brindan la información necesaria para calcular los coeficientes de sustentación y resistencia, necesarios para conocer si es factible o no emplear el modelo en la vida real. </span>\n\n<p><br>\n<span style=\"font-size:14px\"><strong>Otras pruebas realizadas en túneles de viento</strong></span><br>\n </p>\n\n<ul>\n	<li>Pueden unirse hebras a la superficie de estudio para detectar la dirección del flujo de aire y su velocidad relativa.</li>\n	<li><span style=\"font-size:13px\">Pueden inyectarse tintes o humo en el flujo de aire para observar el movimiento de las partículas, o sea, como se turbulizan al pasar por la superficie.</span></li>\n	<li><span style=\"font-size:13px\">Pueden insertarse sondas en puntos específicos del flujo de aire para medir la presión estática y dinámica del aire.</span></li>\n</ul>\n<p></p><p><br></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"tunel 01.jpg\" style=\"width: 808px;\"></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"tunel 02.jpg\" style=\"font-weight: lighter; width: 886px;\"><br></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"tunel 03.jpg\" style=\"width: 886px;\"></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"tunel 04.jpg\" style=\"width: 886px;\"><br></p><p></p>", "tunel"); 
