INSERT INTO `novedades` VALUES("35", "877aca6998", "Importancia del cuidado y mantenimiento de nuestros extractores", "<p dir=\"ltr\">Sabemos que cada producto conlleva un <strong>regular mantenimiento y cuidado para que siempre su funcionamiento y rendimiento sea óptimo</strong>. ¿Pero qué pasa cuando no se le da importancia?</p>\n\n<p dir=\"ltr\">Como consecuencia a este interrogante, lo que se genera es un deterioro y un prematuro daño de la unidad, en este caso del extractor.</p>\n\n<p>Es así como se debe exigir a los extractores de tu fábrica o galpón el sometimiento a una inspección que consiste en <strong>chequear que el extractor y sus partes están funcionando adecuadamente</strong>.</p>\n\n<p>Al encargarse el extractor de mantener su fábrica o galpón libre de humo, gases y polvo las 24 hs es indispensable no descuidarlo, ya que podría afectar la salud de sus colaboradores al inhalar diferentes sustancias posiblemente nocivas que circulan y que el extractor no puede expulsar hacia afuera por su deficiente funcionamiento.</p>\n\n<p>Por eso te dejamos<strong> unos tips sobre cómo mantener tus extractores y optimizar su funcionamiento</strong>:</p>\n\n<ul>\n	<li dir=\"ltr\">\n	<p dir=\"ltr\">Limpiar, balancear y tensar las correas (acoples directos no aplica).</p>\n	</li>\n	<li dir=\"ltr\">\n	<p dir=\"ltr\">Chequear y limpiar todos los componentes (programar un plan de limpieza periódico sería lo ideal)</p>\n	</li>\n	<li dir=\"ltr\">\n	<p dir=\"ltr\">Tener especial cuidado con las partes que están en el flujo de aire, en especial la hélice.</p>\n	</li>\n	<li dir=\"ltr\">\n	<p dir=\"ltr\">Chequear todas las partes por desgaste, reparar o reemplazar si es necesario.</p>\n	</li>\n	<li dir=\"ltr\">\n	<p dir=\"ltr\">Revisar la tornillería, verificar que no se haya aflojado.</p>\n	</li>\n	<li dir=\"ltr\">\n	<p dir=\"ltr\">Prestar especial atención a ruidos extraños, con frecuencia son causados por falta de lubricantes en rodamientos &nbsp;(lubricar o reemplazar)</p>\n	</li>\n</ul>\n\n<p>Como se comentó más arriba es fundamental el mantenimiento de estos extractores, ya que su desperfecto puede ocasionar daños a la integridad física de las personas como así también al deterioro de maquinarias o elementos que se encuentren bajo el irregular funcionamiento de estos extractores.</p>\n", "", "", "", "2018-04-11"); 
INSERT INTO `novedades` VALUES("36", "1e45a1c68d", "Producto Gatti de la semana: extractor de aire industrial para pared", "<p>En Gatti SA pensamos siempre en nuestros clientes y en el cuidado del ambiente en donde desarrollan su actividad profesional o comercial.</p>\n\n<p><strong>En esta oportunidad te presentamos y recomendamos este extractor industrial para pared,</strong> recordando que el objetivo de un extractor es mantener un espacio cerrado con ventilación adecuada pero sobre todo combatir la humedad y los malos olores, estos deben instalarse en función del espacio a ventilar.</p>\n\n<p>Un extractor de aplicación tipo semi o industrial como este está destinado a <strong>aspirar y renovar el aire de espacios</strong> como por ejemplo de baños, vapores de cocina, comedores, bares, restaurantes, kiosco, etc dejando tu ambiente libre de humedad, pudiendo provocar el deterioro de los espacios y la aparición de moho, como así también combatir los malos olores, ya que al absorber los vapores se elimina la presencia de aromas fuertes y desagradables.</p>\n\n<p>Este tipo de extractor con motor axial y de 8 aspas es capaz de<strong> remover grandes volúmenes de aire</strong>. Fabricados completamente de polipropileno y fibra de vidrio convierten a este producto libre de corrosión por lo cual su exposición a ambientes húmedos no lo dañan.</p>\n\n<p>Según el ambiente a colocarlo, estos vienen de diferentes medidas, 35, 45 o 55 cm y están diseñados para uso continuo, además puede agregarse como accesorio un dimmer (regulador de velocidad) que reduce un 50% el rendimiento del equipo.</p>\n\n<p>Ante cualquier consulta sobre este producto comunicate enviándonos un whatsapp al 3564589747 o acercate a nuestra casa central ubicada en Rosario de Santa Fe 298 / San Francisco, Cba. No olvides que al ser fabricantes de estos productos, contamos con todos los repuestos. No dejes de visitar nuestra tienda virtual haciendo <a href=\"http://gattisa.com.ar/tienda\">click aquí</a>.</p>\n", "", "", "", "2018-04-25"); 
