INSERT INTO `novedades` VALUES("38", "10db16a27c", "Producto Gatti de la semana: Cortinas de Aire FM 900 y 1200 mm", "<p>En Gatti siempre pensamos en el confort de nuestros clientes y sobre todo en el espacio donde desarrollan sus trabajos diarios.</p>\n\n<p>En esta ocasión presentaremos las excelentes <strong>Cortinas de Aire FM, que tienen como función principal generar una barrera invisible sobre la puerta del espacio que se desee proteger</strong>, actuando a modo de protección climática y evitando la entrada de insectos, partículas, humos, polvo, humedad, entre otros.</p>\n\n<p>Sin limitar el acceso de personas o vehículos,<strong> este producto es ideal para colocarlos en restaurantes, plantas de productos alimenticios, supermercados, cámaras frigoríficas, shoppings, galerías comerciales, etc. Asegurando el confort y confiabilidad de los usuarios</strong>.</p>\n\n<p>Estas cortinas de aire generan un poderoso sello en la abertura que son colocadas, preservando el ambiente interior, evitando pérdidas de frío o calor.</p>\n\n<p>En Gatti tenemos dos modelos, de 900 mm y de 1200 mm, además se pueden colocar dos juntos si el ancho de la abertura a cubrir supera estas medidas y contás con un año de garantía.</p>\n\n<p>Para adquirir este producto o solicitar más info podés ingresar a nuestra tienda on line haciendo <a href=\"http://gattisa.com.ar/tienda\">click aqui</a> o enviándonos un mail a casacentral@gattisa.com.ar.</p>\n", "", "", "", "2018-06-13"); 
INSERT INTO `novedades` VALUES("39", "0d429c25fc", "Producto Gatti de la semana: Extractor de Aire forzador de conducto para baños y cocinas", "<p>En Gatti SA nos enfocamos en brindar la mejor solución en ventilación de ambientes y espacios. En esta oportunidad <strong>presentamos el novedoso Extractor Tubular de 100 150 y 200 para exterior.</strong></p>\n\n<p>Con la intención de ayudar a purificar espacios de olores, gases, humedad y sustancias tóxicas que podrían impactar en el deterioro de la salud, <strong>estos extractores son diseñados para colocar entre conductos hacia el exterior, ideales para colocar entre conductos de campanas de cocinas o de baños.</strong></p>\n\n<p>Este extractor <strong>tiene una capacidad de purificación de 800m³ por hora, son libres de mantenimiento, además pueden ser aplicados en aire limpio y a una temperatura máxima de aire de 70° C.</strong></p>\n\n<p>Ante cualquier consulta sobre este producto comunicate enviándonos un whatsapp al 3564589747 , además contamos con el servicio de envío sin costo a cualquiera de nuestras tres sucursales, Buenos Aires, Rosario y San Francisco (Cba).&nbsp;</p>\n\n<p>No olvides que al ser fabricantes de estos productos, contamos con todos los repuestos. Conocé más de este producto y los demás visitando nuestra tienda on line haciendo <a href=\"http://gattisa.com.ar/tienda\">click aqui.</a></p>\n", "", "", "", "2018-07-20"); 
