INSERT INTO `portfolio` VALUES("61", "0", "RU", "<p>GENERALIDADES</p>\n\n<p>Los ventiladores centr&iacute;fugos de la serie RU son particularmente aptos para mover aire puro en el campo de las aplicaciones civiles e industriales.<br />\nLa variedad de tama&ntilde;os disponibles permite obtener caudales de hasta 80.000 m3/h, presiones de hasta 300 mm H2O y temperaturas de hasta 300&ordm;C.<br />\nLa construcci&oacute;n robusta con un juego m&iacute;nimo entre partes rotantes y fijas, as&iacute; como el dise&ntilde;o aerodin&aacute;mico de todos los componentes, en especial de la boca aspirante de forma toroidal, hacen que se alcancen los m&aacute;ximos rendimientos.</p>\n\n<p>APLICACIONES</p>\n\n<p>En general en todas las instalaciones de acondicionamiento civil, industrial y naval (desecaci&oacute;n de forrajes y cereales, eliminaci&oacute;n de humos y vapores, aireaci&oacute;n de silos, ventilaci&oacute;n de minas y galer&iacute;as, secado de papel, pastas, etc.)</p>\n", "8", "", "ARS", "0", "0", "100", "archivos/productos/recortadas/a_1180ae.jpg", "archivos/productos/recortadas/a_a36da3.jpg", "archivos/productos/recortadas/a_57b1d3.jpg", "archivos/productos/recortadas/a_1cd1cd.jpg", "", "0", "0", "0000-00-00", "0", "archivos/productos/pdf/b36fb5.pdf", "", ""); 
INSERT INTO `portfolio` VALUES("63", "PERSIANA4", "PERSIANA DE PLÁSTICO MOVIL 4", "<p>MODELO: PERSIANA DE PL&Aacute;STICO 4&quot;</p>\n\n<p>- Generalidades: Este accesorio se utiliza para impedir el paso de insectos, polvo u otros elementos o part&iacute;culas del aire, y de la lluvia en el interior del recinto, en el momento en que el ventilador no se encuentra en funcionamiento. Funciona por gravedad, abri&eacute;ndose y cerr&aacute;ndose con el paso del aire durante el funcionamiento del ventilador, y se mantiene cerrada cuando este est&aacute; apagado.<br />\n- Aplicaciones: para colocar en boca de salida de extractor de aire 4&quot; (EBG 4&quot;)</p>\n\n<p>- Medidas: 15,3 x 15,3 cm</p>\n\n<p>- Di&aacute;metro boca: 10 cm.</p>\n\n<p>- 1 A&Ntilde;O DE GARANT&Iacute;A</p>\n\n<p>* SOMOS FABRICANTES - TENEMOS TODOS LOS REPUESTOS<br />\n* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):<br />\n- CABA<br />\n- ROSARIO<br />\n- SAN FRANCISCO (CBA)</p>\n", "21", "16", "ARS", "260", "0", "8", "archivos/productos/recortadas/a_9e44f1.jpg", "archivos/productos/recortadas/a_80d005.jpg", "archivos/productos/recortadas/a_b76aeb.jpg", "archivos/productos/recortadas/a_9dbd02.jpg", "archivos/productos/recortadas/a_8cc9d3.jpg", "0", "1", "0000-00-00", "0.5", "archivos/productos/pdf/70dac6.php", "", ""); 
