 funci&oacute;n ?Self Clean? seca la unidad interior por dentro evitando la formaci&oacute;n de moho.<br />\n<br />\n<strong>REENCENDIDO AUTOM&Aacute;TICO</strong><br />\nLuego de un corte de energ&iacute;a el equipo se reinicia en la &uacute;ltima temperatura seteada.<br />\n<br />\n<strong>FUNCI&Oacute;N MODO SWING</strong><br />\nFunci&oacute;n Modo swing<br />\n<br />\n<strong>FUNCI&Oacute;N MODO TURBO</strong><br />\nFunci&oacute;n Modo turbo<br />\n<br />\n<strong>SMART COMFORT</strong><br />\nDesde cualquier dispositivo m&oacute;vil o v&iacute;a web. Control&aacute; y ajusta el clima ideal desde donde est&eacute;s.</p>\n\n<p><span style=\"background-color:transparent; color:#333333\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><br />\n<span style=\"background-color:transparent; color:#333333\">- CABA</span><br />\n<span style=\"background-color:transparent; color:#333333\">- ROSARIO</span><br />\n<span style=\"background-color:transparent; color:#333333\">- SAN FRANCISCO (CBA)</span><br />\n<br />\n&nbsp;</p>\n", "22", "4", "ARS", "15140", "15500", "0", "archivos/productos/recortadas/a_43a1e7.jpg", "archivos/productos/recortadas/a_19b0e0.jpg", "archivos/productos/recortadas/a_0566c9.jpg", "archivos/productos/recortadas/a_8aeff5.jpg", "archivos/productos/recortadas/a_ebb4db.jpg", "0", "1", "0000-00-00", "33", "archivos/productos/pdf/090028.pdf", "0N_9NqufnoY", ""); 
