va el aviso l&uacute;m&iacute;nico en el display.<br />\n<br />\n<strong>FUNCI&Oacute;N AUTO LIMPIEZA</strong><br />\nLa funci&oacute;n ?Self Clean? seca la unidad interior por dentro evitando la formaci&oacute;n de moho.<br />\n<br />\n<strong>REENCENDIDO AUTOM&Aacute;TICO</strong><br />\nLuego de un corte de energ&iacute;a el equipo se reinicia en la &uacute;ltima temperatura seteada.<br />\n<br />\n<strong>FUNCI&Oacute;N MODO SWING</strong><br />\nFunci&oacute;n Modo swing<br />\n<br />\n<strong>FUNCI&Oacute;N MODO TURBO</strong><br />\nFunci&oacute;n Modo turbo<br />\n<br />\n<strong>SMART COMFORT</strong><br />\nDesde cualquier dispositivo m&oacute;vil o v&iacute;a web. Control&aacute; y ajusta el clima ideal desde donde est&eacute;s.<br />\n<br />\nDEALER CARRIER / Garant&iacute;a: 3 A&Ntilde;OS</p>\n\n<p><br />\n<span style=\"background-color:transparent; color:#333333\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><br />\n<span style=\"background-color:transparent; color:#333333\">- CABA</span><br />\n<span style=\"background-color:transparent; color:#333333\">- ROSARIO</span><br />\n<span style=\"background-color:transparent; color:#333333\">- SAN FRANCISCO (CBA)</span><br />\n&nbsp;</p>\n", "22", "4", "ARS", "45500", "51500", "1", "archivos/productos/recortadas/a_d9b93a.jpg", "archivos/productos/recortadas/a_59fa40.jpg", "archivos/productos/recortadas/a_a11c4c.jpg", "archivos/productos/recortadas/a_b7e8ae.jpg", "archivos/productos/recortadas/a_064414.jpg", "0", "1", "0000-00-00", "70", "archivos/productos/pdf/391759.pdf", "0N_9NqufnoY", ""); 
