INSERT INTO `portfolio` VALUES("84", "MIDEA LUMINA2350", "SPLIT MIDEA LUMINA  II - 2350 Kcal FRIO SOLO", "<p>MARCA: MIDEA 2350 Kcal/H FRIO SOLO</p>\n\n<p>- Modelo: MSNI-09C-01F</p>\n\n<p>- Origen: Argentina</p>\n\n<p><strong>C</strong><strong>ARACTER&Iacute;STICAS DEL EQUIPO</strong></p>\n\n<p>- Consumo: Refrigeraci&oacute;n 0.836&nbsp;KW</p>\n\n<p>- Frigor&iacute;as: 2350</p>\n\n<p>- Corriente: A 3.9</p>\n\n<p>- Potencia el&eacute;ctrica: 2700 W</p>\n\n<p>- Eficiencia energ&eacute;tica fr&iacute;o: 3.27 EER</p>\n\n<p>- Dimensiones unidad interior: 25 x 71.5 x 18.8 cm</p>\n\n<p>- Dimensiones unidad exterior: 54 x 70 x 24 cm</p>\n\n<p><strong>- </strong>Garant&iacute;a: 1 a&ntilde;o de f&aacute;brica</p>\n\n<p>- Dise&ntilde;ado con l&iacute;neas suaves y minimalistas, alta eficiencia energ&eacute;tica y m&iacute;nimo nivel sonoro, garantiza el clima perfecto en todos tus ambientes. Aire acondicionado con innovador Led display de temperatura con encendido opcional.</p>\n\n<p><strong>ALTA EFICIENCIA:</strong> Este equipo se ubica en la mas alta performance de ahorro energ&eacute;tico contribuyendo a la reducci&oacute;n del consumo y un menos impacto ambiental.<br />\n<br />\n<strong>MODO TURBO</strong><br />\nBrinda al usuario la posibilidad de acceder a la temperatura deseada r&aacute;pidamente. Desde el control remoto se puede disponer de esta funci&oacute;n que ordena al equipo operar a alta velocidad hasta alcanzar la temperatura seteada. Recuperar&aacute; el normal funcionamiento, luego de operar en este modo por 20 minutos.<br />\n<br />\n<strong>REENCENDIDO AUTOM&Aacute;TICO</strong><br />\nEl acondicionador de aire se reiniciar&aacute; autom&aacute;ticamente, luego de una interrupci&oacute;n en la corriente el&eacute;ctrica, continuando con las funciones previamente seteadas.<br />\n<br />\n<strong>CONTROL REMOTO</strong><br />\nPara comodidad del usuario, el L&uacute;mina II cuenta con un control remoto con display de LCD (Pantalla de Cristal L&iacute;quido) desde el cual se podr&aacute; setear la temperatura deseada y programar el encendido o apagado del equipo. Tambi&eacute;n las funciones de modo turbo, modo sleep, ventilaci&oacute;n, etc.<br />\n<br />\n<strong>REFRIGERANTE ECOL&Oacute;GICO</strong><br />\nA fin de mejorar la eficiencia, y disminuir el impacto ambiental, este equipo cuenta con refrigerante R410A que no da&ntilde;a la capa de ozono contribuyendo a cuidar el medio ambiente.<br />\n<br />\n<strong>ALTA EFICIENCIA</strong><br />\nEste equipo se ubica en la m&aacute;s alta performance de ahorro energ&eacute;tico contribuyendo a la reducci&oacute;n del consumo y un menor impacto ambiental.<br />\n<br />\n<strong>MEMORIA POSICI&Oacute;N LOUVER</strong><br />\nEsta funci&oacute;n es totalmente autom&aacute;tica. Memoriza la &uacute;ltima posici&oacute;n seteada en la paleta direccional de aire del equipo, posibilitando que al encenderlo, comience a funcionar en el &aacute;ngulo anteriormente deseado. En caso de corte de luz o interrupci&oacute;n del funcionamiento de la unidad, el deflector regresar&aacute; al &aacute;ngulo fijado por default en el equipo.<br />\n<br />\n<strong>MODO SLEEP</strong><br />\nLa funci&oacute;n &quot;Sleep&quot; permite que el aire trabaje durante la noche, ajustando gradualmente la temperatura posibilitando el ahorro de energia y el total confort del usuario en el momento de su descanso.<br />\n<br />\n<strong>DETECCI&Oacute;N P&Eacute;RDIDA DE REFRIGERANTE</strong><br />\nMediante un sistema de sensores el equipo es capaz de detectar una p&eacute;rdida de refrigerante en el sistema y lo indica en el display de la unidad interior. Esto facilita la detecci&oacute;n de problemas y evita un funcionamiento deficiente.</p>\n\n<p>&nbsp;</p>\n\n<p>* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 4 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):<br />\n- CABA<br />\n- ROSARIO<br />\n- C&Oacute;RDOBA CAPITAL<br />\n- SAN FRANCISCO (CBA)<br />\n&nbsp;</p>\n\n<p>&nbsp;</p>\n", "22", "5", "ARS", "9870", "0", "0", "archivos/productos/recortadas/a_f1b881.jpg", "archivos/productos/recortadas/a_07bf04.jpg", "archivos/productos/recortadas/a_2da02a.jpg", "archivos/productos/recortadas/a_442c17.jpg", "archivos/productos/recortadas/a_fb272e.jpg", "0", "1", "0000-00-00", "32", "archivos/productos/pdf/f14b5c.pdf", "", ""); 
