INSERT INTO `portfolio` VALUES("92", "VTSUPERLUJO", "VENTILADOR DE TECHO MADERA - MODELO: SUPER LUJO", "<p><strong>- MODELO: VENTILADOR SUPER LUJO</strong></p>\n\n<p><strong>GENERALIDADES</strong></p>\n\n<p>- Motor de bajo consumo. Permite un uso continuo del aparato sin levantar temperatura que afecte sus componentes vitales.<br />\n- Palas de madera reversibles. Sus palas presentan dos tonalidades diferentes (blanco / haya); brind&aacute;ndole al Usuario la posibilidad de renovar la imagen de su Ventilador de Techo.<br />\n- Compatibles con artefactos de iluminaci&oacute;n (Luminaria).<br />\n- Caja selectora de 5 velocidades.</p>\n\n<p>- Poseen motor a rodamientos de bajo consumo y garant&iacute;a de 1 a&ntilde;o. Para uso dom&eacute;stico, comercial e industrial.</p>\n\n<p>- Todos nuestros ventiladores de techo son silenciosos y de f&aacute;cil instalaci&oacute;n. Poseen motor a rodamientos de bajo consumo y garant&iacute;a de 1 a&ntilde;o. Para uso dom&eacute;stico, comercial e industrial</p>\n\n<p><strong>APLICACIONES</strong></p>\n\n<p>En hogares, oficinas, locales comerciales, departamentos, etc.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n", "11", "", "ARS", "0", "0", "100", "archivos/productos/recortadas/a_103a06.png", "archivos/productos/recortadas/a_461f86.jpg", "archivos/productos/recortadas/a_622479.jpg", "", "", "0", "0", "0000-00-00", "0", "", "", ""); 
