INSERT INTO `portfolio` VALUES("132", "VARIATENC", "VARIADOR DE TENSIÓN ENCHUFABLE", "<div><strong>- MODELO: REGULADOR DE TENSI&Oacute;N ENCHUFABLE 1200w</strong></div>\n\n<div>- Permite modificar la velocidad del motor de una herramienta de mano (taladro, lijadora, lustradora, etc.), la temperatura de un calefactor el&eacute;ctrico (pistola de aire caliente), la temperatura de una soldadora de impulso para pl&aacute;sticos o la intensidad de un artefacto luminoso.<br />\nOperaci&oacute;n:<br />\n- Para variar la velocidad, temperatura o luminosidad, se gira la perilla de su frente.<br />\nInstalaci&oacute;n:<br />\n- Debe conectarse en forma intercalada, entre el tomacorriente de la instalaci&oacute;n y la ficha macho del artefacto a controlar.<br />\n- Utilizar exclusivamente en interiores.</div>\n\n<div>&nbsp;</div>\n\n<div><strong>CARACTER&Iacute;STICAS:</strong><br />\n&bull; Tensi&oacute;n de alimentaci&oacute;n: 220 V 50 - 60 Hz.<br />\n&bull; Posee llave de corte.<br />\n&bull; Salida a Triac.<br />\n&bull; Dispocitivo: clase II<br />\n&bull; Color: negro<br />\n&bull; Uso : interior<br />\n&bull; Peso: 140 gramos.<br />\n&bull; Presentaci&oacute;n: en bl&iacute;ster<br />\n&bull; Instalaci&oacute;n r&aacute;pida y f&aacute;cil<br />\n&bull; Regulaci&oacute;n cont&iacute;nua<br />\n&bull; Permite ahorrar de energ&iacute;a<br />\n&bull; Cumple normas de seguridad</div>\n\n<div>&nbsp;</div>\n\n<div>- 6 MESES DE GARANT&Iacute;A</div>\n\n<div><br />\n<span style=\"background-color:transparent; color:#333333\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><br />\n<span style=\"background-color:transparent; color:#333333\">- CABA</span><br />\n<span style=\"background-color:transparent; color:#333333\">- ROSARIO</span><br />\n<span style=\"background-color:transparent; color:#333333\">- SAN FRANCISCO (CBA)</span></div>\n\