INSERT INTO `portfolio` VALUES("150", "KRM550/4P", "Extractor De Aire Industrial 55 Cm Para Pared ", "<div>- MODELO: KRM 550/4 P<br />\n- Extractor de aire axial industrial de 55 cm<br />\n- Aplicaciones industriales y aspiraci&oacute;n de campana de cocina industriales<br />\n- Pueden trabajar vertical u horizontalmente<br />\n- H&eacute;lices: en P (polipropileno y fibra de vidrio) de &aacute;ngulo variable, de alto rendimiento. 8 aspas<br />\n- Aros: Aro R de 1 pesta&ntilde;a para pared. Repujados en chapa de acero.<br />\n- Motor: industrial blindado monof&aacute;sico<br />\n- Caudal: 7920 m3 hora<br />\n- Potencia: 0,75 HP<br />\n- RPM: 1500<br />\n- Dise&ntilde;ado para uso continuo<br />\n- Puede agregarse como accesorio un DIMMER (regulador de velocidad) que reduce un 50% el rendimiento del equipo y Persiana m&oacute;vil o fija</div>\n\n<div>&nbsp;</div>\n\n<div>- 1 A&Ntilde;O DE GARANT&Igrave;A<br />\n* SOMOS FABRICANTES - TENEMOS TODOS LOS REPUESTOS</div>\n\n<div>&nbsp;</div>\n\n<div>* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( CUANDO REALIZAS LA COMPRA COLOCAS &quot;LO RETIRO EN EL DOMICILIO DEL VENDEDOR&quot; &ndash; NO IMPORTA LA DIRECCION QUE TE MUESTRE EL SITIO LO COORDIANS CON NOSOTROS ):<br />\n- CABA<br />\n- ROSARIO<br />\n- SAN FRANCISCO (CBA)</div>\n\n<div>* HACEMOS ENV&Igrave;OS A TODO EL PA&Igrave;S (CONSULTAR)</div>\n", "23", "17", "ARS", "9864", "0", "1", "archivos/productos/recortadas/a_15996e.JPG", "archivos/productos/recortadas/a_b4aa2c.JPG", "archivos/productos/recortadas/a_3e851a.jpg", "", "", "0", "1", "0000-00-00", "30", "archivos/productos/pdf/0e01e11c3209353.pdf", "", ""); 
