INSERT INTO `portfolio` VALUES("164", "FM 900 Y 1200", "CORTINA DE AIRE FM 900 Y 1200", "<p style=\"margin-left:0px; margin-right:0px; text-align:left\">GENERALIDADES</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">&nbsp;La cortina de aire FM viene en 2 medidas: 900 y 1200 mm.&nbsp; Montadas totalmente sobre rodamientos. Construidas en chapa de acero con rotor de pl&aacute;stico, balanceadas est&aacute;tica y din&aacute;micamente. Posee 2 velocidades y cuenta con control remoto. No se fabrican con resistencia.&nbsp;</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">&nbsp;Generan una poderosa pared de aire que impide que el flujo de aire caliente o fr&iacute;o pase de un ambiente a otro. Adem&aacute;s, no permite el paso de insectos, polvo, humedad y otros contaminantes.</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">APLICACIONES</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">Los dos modelos de cortinas de aire permiten su uso en un amplio rango aberturas y tipo de instalaciones con y sin calor como ser: Centros Comerciales, Farmacias, Laboratorios, ambientes industriales, C&aacute;maras Frigor&iacute;ficas, ambientes presurizados etc.</p>\n", "10", "", "ARS", "0", "0", "100", "archivos/productos/recortadas/a_bd141e.jpg", "archivos/productos/recortadas/a_acb4cd.jpg", "archivos/productos/recortadas/a_9776bd.jpg", "archivos/productos/recortadas/a_246827.jpg", "archivos/productos/recortadas/a_8dec92.jpg", "0", "0", "0000-00-00", "0", "archivos/productos/pdf/d64198.pdf", "", ""); 
INSERT INTO `portfolio` VALUES("165", "KRT350 TRIFÁ.", "EXTRACTOR DE AIRE INDUSTRIAL 35 CM TRIFÁSICO PARA PARED", "<div><em><strong>- MODELO: KRM 350/4 P TRIF&Aacute;SICO</strong></em><br />\n- Extractor de aire axial de 35 cm (di&aacute;metro boca interna)<br />\n- Di&aacute;metro interno: 35,5 cm<br />\n- Di&aacute;metro externo: 45,4 cm<br />\n- Profundidad total: 42 cm<br />\n- Aplicaciones industriales y aspiraci&oacute;n de campana de cocina industriales<br />\n- pueden trabajar vertical u horizontalmente<br />\n- H&eacute;lices: en P (polipropileno y fibra de vidrio) de &aacute;ngulo variable, de alto rendimiento.<br />\n- Aros: Aro R de 1 pesta&ntilde;a para pared. Repujados en chapa de acero.<br />\n- H&eacute;lice de 8 aspas en polipropileno y fibra de vidrio<br />\n- Motor: industrial blindado trif&aacute;sico<br />\n- Caudal: 2800 m3 hora<br />\n- Potencia: 0,33 HP<br />\n- RPM: 1400<br />\n- Dise&ntilde;ado para uso continuo<br />\n- Puede agregarse como accesorio un DIMMER (regulador de velocidad) que reduce un 50% el rendimiento del equipo<br />\n- Tambi&eacute;n se fabrican a 900 o 2800 RPM</div>\n\n<div>&nbsp;</div>\n\n<div><em>* EN EL CASO DE QUE NO HAYA STOCK DISPONIBLE, TIENE 10 D&Iacute;AS DE DEMORA PARA FABRICARSE. </em></div>\n\n<div>&nbsp;</div>\n\n<div>- 1 A&Ntilde;O DE GARANT&Igrave;A<br />\n* SOMOS FABRICANTES - TENEMOS TODOS LOS REPUESTOS</div>\n\n<div>\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):<br />\n- CABA<br />\n- ROSARIO<br />\n- SAN FRANCISCO (CBA)</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">&nbsp;</p>\n</div>\n", "23", "17", "ARS", "9100", "0", "1", "archivos/productos/recortadas/a_02902c.JPG", "archivos/productos/recortadas/a_df36fd.JPG", "archivos/productos/recortadas/a_0228f5.jpg", "", "", "0", "1",