INSERT INTO `portfolio` VALUES("177", "EÓLICO24+BASE", "Extractor Eolico 24 Pulgadas Galvanizado C/ Rod. + Base ", "<div>&nbsp;MODELO: EXTRACTOR E&Oacute;LICO DE 15&quot; (37,5 CM) + BASE<br />\n- Di&aacute;metro Boca e&oacute;lico: 24&quot; (61,5 cm).<br />\n- Rodamientos blindados<br />\n- Material: Chapa Galvanizada<br />\n- Extrae: 600 m3 x hora.<br />\n- &Oslash; boca de aspiraci&oacute;n: 61,5 cm<br />\n- Altura: 56 cm<br />\n- Este tipo de extractor tienen la capacidad de extraer humos, gases, polvos y olores las 24 Hs del d&iacute;a, rotando la acci&oacute;n del viento o por diferencia de temperatura ambiente, sin producir ruidos.<br />\n- Su construcci&oacute;n SIN MOTOR no produce ning&uacute;n gasto de energ&iacute;a y hace que no requiera mantenimiento.<br />\n- Puede utilizarse para instalar en finales de conductos de ba&ntilde;os y cocinas, en salidas de calef&oacute;n, en cielorrasos, ambientes peque&ntilde;os, etc.</div>\n\n<div>&nbsp;</div>\n\n<div>BASE<br />\n- Chapa galvanizada<br />\n- Listo para colocar en cualquier techo<br />\n- Se ofrecen con inclinaci&oacute;n para adaptar a techo 2 aguas</div>\n\n<div>&nbsp;</div>\n\n<div>- GARANT&Iacute;A 1 A&Ntilde;O</div>\n\n<div>\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"font-size:14px\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):<br />\n- CABA<br />\n- ROSARIO<br />\n- SAN FRANCISCO (CBA)</span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">&nbsp;</p>\n</div>\n", "23", "17", "ARS", "6599", "0", "2", "archivos/productos/recortadas/a_feefd7.jpg", "archivos/productos/recortadas/a_93b713.jpg", "archivos/productos/recortadas/a_dcb7e7.jpg", "archivos/productos/recortadas/a_35980e.jpg", "archivos/productos/recortadas/a_f8275e.jpg", "0", "1", "0000-00-00", "20", "", "", ""); 
