INSERT INTO `portfolio` VALUES("181", "KUM450/4P", "Extractor De Aire Industrial 45 Cm Monofásico P/ Conducto", "<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><em><strong>- MODELO: KUM 450/4 P MONOF&Aacute;SICO</strong></em><br />\n- Extractor de aire axial de 45 cm<br />\n- Di&aacute;metro interno: 45,6 cm<br />\n- Di&aacute;metro externo: 54,6 cm<br />\n- Profundidad total: 51 cm<br />\n- Aplicaciones industriales y aspiraci&oacute;n de campana de cocina industriales.<br />\n- Pueden trabajar vertical u horizontalmente<br />\n- H&eacute;lices: en P (polipropileno y fibra de vidrio) de &aacute;ngulo variable, de alto rendimiento.<br />\n- Aros: Aro R de 2 pesta&ntilde;a para entubar. Repujados en chapa de acero.<br />\n- H&eacute;lice de polipropileno y fibra de vidrio de 8 aspas<br />\n- Motor: industrial blindado monof&aacute;sico<br />\n- Caudal: 5000 m3 hora<br />\n- Potencia: 0,33 HP<br />\n- RPM: 1400<br />\n- Dise&ntilde;ado para uso continuo<br />\n- Puede agregarse como accesorio un DIMMER (regulador de velocidad) que reduce un 50% el rendimiento del equipo<br />\n- Tambi&eacute;n se fabrican a 900 o 2800 RPM</span></span><br />\n&nbsp;<br />\n<em>* EN EL CASO DE QUE NO HAYA STOCK DISPONIBLE, TIENE 10 D&Iacute;AS DE DEMORA PARA FABRICARSE</em>.<br />\n<br />\n<span style=\"font-size:14px\"><span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- 1 A&Ntilde;O DE GARANT&Igrave;A</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">* SOMOS FABRICANTES - TENEMOS TODOS LOS REPUESTOS</span></span></p>\n\n<p><span style=\"background-color:transparent; color:#333333\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><b