 GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):<br />\n- CABA<br />\n- ROSARIO<br />\n- SAN FRANCISCO (CBA)</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">&nbsp;</p>\n</div>\n", "21", "13", "ARS", "4700", "0", "2", "archivos/productos/recortadas/a_829f06.jpg", "archivos/productos/recortadas/a_3d7e4a.jpg", "archivos/productos/recortadas/a_bd8a87.-min", "archivos/productos/recortadas/a_2386ac.jpg", "archivos/productos/recortadas/a_144e61.jpg", "0", "1", "0000-00-00", "6", "", "", ""); 
INSERT INTO `portfolio` VALUES("185", "PERS PLÁSTICA 20CM", "Persiana Movil Plástica 20 Cm P/ Extractor", "<p><span style=\"font-size:14px\"><span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- MODELO: PERSIANA PL&Aacute;STICA MOVIL 200 MM</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">GENERALIDADES:</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">Este accesorio se utiliza para impedir el paso de insectos, polvo u otros elementos o part&iacute;culas del aire, y de la lluvia en el interior del recinto, en el momento en que el ventilador no se encuentra en funcionamiento. Funciona por gravedad, abri&eacute;ndose y cerr&aacute;ndose con el paso del aire durante el funcionamiento del ventilador, y se mantiene cerrada cuando este est&aacute; apagado.</span><br />\n<br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">DETALLES CONSTRUCTIVOS</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Fabricado en alto impacto con UV para protecci&oacute;n de da&ntilde;os solares</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Marco cuadrado exterior de 30 x 30 cm</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Marco interior de 22 x 22 cm</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Para colocar en extractor de 20 cm</span></span><br />\n&nbsp;</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"background-color:transparent; color:#333333\">- 1 A&Ntilde;O DE GARANT&Iacute;A</span><br />\n<span style=\"background-color:transparent; color:#333333\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><br />\n<span style=\"background-color:transparent; color:#333333\">- CABA</span><br />\n<span style=\"background-color:transparent; color:#333333\">- ROSARIO</span><br />\n<span style=\"background-color:transparent; color:#333333\">- SAN FRANCISCO (CBA)</span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">&nbsp;</p>\n\n<p>&nbsp;</p>\n", "21", "16", "ARS", "600", "0", "10", "archivos/productos/recortadas/a_aab865.jpg", "archivos/productos/recortadas/a_79a7bb.jpg", "archivos/productos/recortadas/a_f57a93.jpg", "", "", "0", "1", "0000-00-00", "0.5", "", "", ""); 
