INSERT INTO `portfolio` VALUES("194", "CACR 700", "CORTINA DE AIRE 70 CM FRÍO/CALOR - CACR 700", "<div><strong><span style=\"font-size:14px\">MODELO: CORTINA DE AIRE CACR 700</span></strong></div>\n\n<div><span style=\"font-size:14px\">*GENERALIDADES<br />\nMontadas totalmente sobre rodamientos. Construidas en chapa de acero con rotor de chapa de aluminio y galvanizada, balanceadas est&aacute;tica y din&aacute;micamente, generan una poderosa pared de aire que impide que el flujo de aire caliente o fr&iacute;o pase de un ambiente a otro. Adem&aacute;s, no permite el paso de insectos, polvo, humedad y otros contaminantes.</span></div>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-size:14px\"><strong>* DATOS T&Eacute;CNICOS</strong><br />\n- Largo total: 70 cm<br />\n- Medidas: 700 mm largo x 200 mm profundidad x 200 mm altura<br />\n- RPM: 1420<br />\n- V: 220<br />\n- Ruido: 68 Dba<br />\n- Alcance del aire hasta 2 metros</span></div>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-size:14px\">&nbsp;*ESTAS CORTINAS SE FABRICAN A PEDIDO - DEMORA APROX. DE 30 D&Iacute;AS</span></div>\n\n<div>\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"font-size:14px\">- 1 A&Ntilde;O DE GARANT&Igrave;A<br />\n* SOMOS FABRICANTES - TENEMOS TODOS LOS REPUESTOS</span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"font-size:14px\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):<br />\n- CABA<br />\n- ROSARIO<br />\n- SAN FRANCISCO (CBA)</span></p>\n</div>\n", "23", "20", "ARS", "21000", "0", "1", "archivos/productos/recortadas/a_1850dd.jpg", "archivos/productos/recortadas/a_4ca646.jpg", "archivos/productos/recortadas/a_b1bc2a.jpg", "archivos/productos/recortadas/a_bda224.jpg", "archivos/productos/recortadas/a_c2f00d.jpg", "0", "1", "0000-00-00", "15", "archivos/productos/pdf/37a1380e141a