INSERT INTO `portfolio` VALUES("204", "", "VENTILADOR DE TECHO CHAPA - MODELO: LUJO", "<p style=\"margin-left:0px; margin-right:0px; text-align:left\">- MODELO: VENTILADOR LUJO</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">GENERALIDADES</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">Ventilador de techo de madera de 120 cm de di&aacute;metro. Fabricado en 2 colores: haya y caoba. Disponible con cubre motor y herrajes en color dorado o plateado.&nbsp;</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">Todos nuestros ventiladores de techo son silenciosos y de f&aacute;cil instalaci&oacute;n. Poseen motor a rodamientos de bajo consumo y garant&iacute;a de 1 a&ntilde;o. Para uso dom&eacute;stico, comercial e industrial.</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">- Motor de bajo consumo. Permite un uso continuo del aparato sin levantar temperatura que afecte sus componentes vitales.<br />\n- Compatibles con artefactos de iluminaci&oacute;n (Luminaria).<br />\n- Caja selectora de 5 velocidades.</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">APLICACIONES</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">En hogares, oficinas, locales comerciales, departamentos, etc.&nbsp;</p>\n", "11", "", "ARS", "0", "0", "100", "archivos/productos/recortadas/a_a226da.jpg", "archivos/productos/recortadas/a_7aaafe.jpg", "archivos/productos/recortadas/a_71620d.jpg", "archivos/productos/recortadas/a_f99ae8.png", "archivos/productos/recortadas/a_6a9875.jpg", "0", "0", "0000-00-00", "0", "archivos/productos/pdf/a2c3d2.pdf", "jbk0LY9mhyw", ""); 
INSERT INTO `portfolio` VALUES("205", "", "CA BOX ", "<p>GENERALIDADES</p>\n\n<p>Para aire limpio y humo. Aplicables en acondicionamiento de aire, sistemas de ventilaci&oacute;n, etc. Doble boca de aspiraci&oacute;n. Caudales: desde 10 m3/h a 25000 m3/h. Presiones: desde 60 Pa hasta 1000 Pa. Rotor multipala SIROCCO. Estos ventiladores centr&iacute;fugos serie CA est&aacute;n proyectados para su aplicaci&oacute;n en movimientos de aire a baja y media presi&oacute;n a una temperatura m&aacute;xima de 50&ordm;C.</p>\n\n<p>APLICACIONES</p>\n\n<p><span style=\"background-color:transparent; color:#333333\">Estos ventiladores centr&iacute;fugos est&aacute;n proyectados para su aplicaci&oacute;n en movimiento de aire de baja y media presi&oacute;n a una temperatura m&aacute;xima de 50&ordm;C. Caracol construido en chapa de acero com&uacute;n o chapa galvanizada. Para aplicar en quir&oacute;fanos, reforzar conductos de aire acondicionado, etc.&nbsp;</span></p>\n", "8", "", "ARS", "0", "0", "100", "archivos/productos/recortadas/a_7b688c.jpg", "archivos/productos/recortadas/a_5b9ef2.jpg", "archivos/productos/recortadas/a_3013d5.jpg", "", "", "0", "0", "0000-00-00", "0", "archivos/productos/pdf/a9fabff7ee7f340.pdf", "", ""); 
