INSERT INTO `portfolio` VALUES("224", "OVI 315 ", "EXTRACTOR  SEMI INDUSTRIAL PARA BAÑO/COCINA 31.5 CM PARA PARED ", "<p><span style=\"color:#000000\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:14px\"><em><strong><span style=\"background-color:transparent\">- MODELO: EXTRACTOR OV1 315</span></strong></em><br />\n<span style=\"background-color:transparent\">-Ventilador Axial para montar en pared</span><br />\n<span style=\"background-color:transparent\">- Unidad s&oacute;lida, compacta y chata. De gran caudal y bajas presiones, para trabajar en un rango de temperaturas que oscila entre 0&ordm;C y 40&ordm;C.</span><br />\n<span style=\"background-color:transparent\">- Construido en acero con revestimiento polim&eacute;rico</span><br />\n<span style=\"background-color:transparent\">- Motor as&iacute;ncrono monof&aacute;sico est&aacute; equipado con protecci&oacute;n contra sobrecalentamiento t&eacute;rmico con reinicio autom&aacute;tico</span><br />\n<span style=\"background-color:transparent\">- Protecci&oacute;n IP 44</span><br />\n<span style=\"background-color:transparent\">- Apto para servicios continuos en condiciones exigentes</span><br />\n<span style=\"background-color:transparent\">- Voltaje: 220 V</span><br />\n<span style=\"background-color:transparent\">- Frecuencia: 50 / 60 Hz</span><br />\n<span style=\"background-color:transparent\">- Potencia: 110 / 104 W</span><br />\n<span style=\"background-color:transparent\">- Caudal m&aacute;ximo: 1700 m3/h</span><br />\n<span style=\"background-color:transparent\">- RPM: 1300 </span><br />\n<span style=\"background-color:transparent\">- Sonido: 42 dBa </span><br />\n<span style=\"background-color:transparent\">- Tipo de protecci&oacute;n: IP 44</span><br />\n<br />\n<span style=\"background-color:transparent\">- 1 A&Ntilde;O DE GARANT&Igrave;A</span></span></span></span></p>\n\n<p><span style=\"color:#000000\"><span style=\"font-family:Arial,Helvetica,sans-ser