INSERT INTO `portfolio` VALUES("236", "VENTS 100 + PERSIANA ", "Extractor De Baño 4 (10 Cm) Vents + Persiana 4\" ", "<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><em><strong><span style=\"background-color:transparent\">MODELO: VENTS 100 S</span></strong></em><br />\n<span style=\"background-color:transparent\">- La carcasa y la h&eacute;lice est&aacute;n construidas en pl&aacute;stico de alta calidad, resistente a los rayos UV. Silencioso y delgado.</span><br />\n<span style=\"background-color:transparent\">- Dise&ntilde;ado para renovar el aire contaminado o h&uacute;medo de ba&ntilde;os, oficinas y peque&ntilde;as habitaciones.</span><br />\n<span style=\"background-color:transparent\">- F&aacute;cil instalaci&oacute;n en paredes, techos, vidrio o cielorrasos.</span><br />\n<span style=\"background-color:transparent\">- Rejilla protectora contra insectos</span><br />\n<span style=\"background-color:transparent\">- Protecci&oacute;n IP 34.</span><br />\n<span style=\"background-color:transparent\">- Dise&ntilde;ado para un funcionamiento continuo y no requiere mantenimiento.</span><br />\n<span style=\"background-color:transparent\">- Motor potenciado con bujes auto lubricados</span><br />\n<span style=\"background-color:transparent\">- Para ambientes aproximados de 5m2</span><br />\n<span style=\"background-color:transparent\">- Se adapta a conductos y accesorios de 10 cm</span><br />\n<span style=\"background-color:transparent\">- Se fi&shy;ja a la pared a trav&eacute;s de tornillos</span><br />\n<span style=\"background-color:transparent\">- Puede montarse en techos y cielorrasos.</span><br />\n<span style=\"background-color:transparent\">- Incluye los tornillos para colocarlo</span><br />\n<span style=\"background-color:transparent\">- Potencia: 7 W</span><br />\n<span style=\"background-color:transparent\">- Extracci&oacute;n: 2.5 m3 x min.</span><br />\n<span style=\"background-color:transparent\">- Consumo: 0,0035 A</span><br />\n<span style=\"background-color:transparent\">- Nivel sonoro: 26 dBA</span><br />\n<span style=\"background-color:transparent\">- Peso: 0.520 Kgs</span><br />\n<span style=\"background-color:transparent\">- Medidas: 150 mm de alto x 150 mm de base x 110 mm di&aacute;metro del conducto.</span><br />\n<br />\n<em><strong><span style=\"background-color:transparent\">MODELO: PERSIANA DE PL&Aacute;STICO 4&quot; / 10 cm</span></strong></em><br />\n<span style=\"background-color:transparent\">- Generalidades: Este accesorio se utiliza para impedir el paso de insectos, polvo u otros elementos o part&iacute;culas del aire, y de la lluvia en el interior del recinto, en el momento en que el ventilador no se encuentra en funcionamiento. Funciona por gravedad, abri&eacute;ndose y cerr&aacute;ndose con el paso del aire durante el funcionamiento del ventilador, y se mantiene cerrada cuando este est&aacute; apagado.</span><br />\n<span style=\"background-color:transparent\">- Aplicaciones: para colocar en boca de salida de extractor de aire 4&quot; (EBG 4&quot;) / 10 cm</span><br />\n<span style=\"background-color:transparent\">- Medidas: 15,3 x 15,3 cm</span><br />\n<span style=\"background-color:transparent\">- Di&aacute;metro boca: 10 cm.</span></span></span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"color:#000000\"><span style=\"font-size:14px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:transparent\">- 1 A&Ntilde;O DE GARANT&Iacute;A</span></span></span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"color:#000000\"><span style=\"font-size:14px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:transparent\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES (SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O): CABA / ROSARIO / SAN FRANCISCO&nbsp;</span></span></span></span></p>\n", "21", "12", "ARS", "1150", "0", "10", "archivos/productos/recortadas/a_5eed28.jpg", "archivos/productos/recortadas/a_bb17d6.png", "archivos/productos/recortadas/a_279d1d.jpg", "archivos/productos/recortadas/a_066187.jpg", "archivos/productos/recortadas/a_c274dc.jpg", "0", "1", "0000-00-00", "1", "", "", ""); 
INSERT INTO `portfolio` VALUES("237", "VENTS 150 + PERSIANA ", "Extractor De Baño 6 (15 Cm) Vents + Persiana 6\"", "<p><span style=\"color:#000000\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:14px\"><em><strong><span style=\"background-color:transparent\">MODELO: VENTS 150 S</span></strong></em><br />\n<span style=\"background-color:transparent\">- La carcasa y la h&eacute;lice est&aacute;n construidas en pl&aacute;stico de alta calidad, resistente a los rayos UV. Silencioso y delgado.</span><br />\n<span style=\"background-color:transparent\">- Dise&ntilde;ado para renovar el aire contaminado o h&uacute;medo de ba&ntilde;os, oficinas y peque&ntilde;as habitaciones.</span><br />\n<span style=\"background-color:transparent\">- F&aacute;cil instalaci&oacute;n en paredes, techos, vidrio o cielorrasos.</span><br />\n<span style=\"background-color:transparent\">- Rejilla protectora contra insectos</span><br />\n<span style=\"background-color:transparent\">- Protecci&oacute;n IP 34.</span><br />\n<span style=\"background-color:transparent\">- Dise&ntilde;ado para un funcionamiento continuo y no requiere mantenimiento.</span><br />\n<span style=\"background-color:transparent\">- Motor potenciado con bujes auto lubricados</span><br />\n<span style=\"background-color:transparent\">- Para ambientes aproximados de 12m2</span><br />\n<span style=\"background-color:transparent\">- Se adapta a conductos y accesorios de 15 cm</span><br />\n<span style=\"background-color:transparent\">- Se fi&shy;ja a la pared a trav&eacute;s de tornillos</span><br />\n<span style=\"background-color:transparent\">- Puede montarse en techos y cielorrasos.</span><br />\n<span style=\"background-color:transparent\">- Incluye los tornillos para colocarlo</span><br />\n<span style=\"background-color:transparent\">- Potencia: 20 W</span><br />\n<span style=\"background-color:transparent\">- Extracci&oacute;n: 6 m3 x min.</span><br />\n<span style=\"background-color:transparent\">- Consumo: 0,14 A</span><br />\n<span style=\"background-color:transparent\">- Nivel sonoro: 33 dBA</span><br />\n<span style=\"background-color:transparent\">- Peso: 0.850 Kgs</span><br />\n<span style=\"background-color:transparent\">- Medidas: 205 mm de alto x 205 mm de base x 150 mm di&aacute;metro del conducto.</span><br />\n<br />\n<em><strong><span style=\"background-color:transparent\">MODELO: PERSIANA DE PL&Aacute;STICO 6&quot; / 15 cm</span></strong></em><br />\n<span style=\"background-color:transparent\">- Generalidades: Este accesorio se utiliza para impedir el paso de insectos, polvo u otros elementos o part&iacute;culas del aire, y de la lluvia en el interior del recinto, en el momento en que el ventilador no se encuentra en funcionamiento. Funciona por gravedad, abri&eacute;ndose y cerr&aacute;ndose con el paso del aire durante el funcionamiento del ventilador, y se mantiene cerrada cuando este est&aacute; apagado.</span><br />\n<span style=\"background-color:transparent\">- Aplicaciones: para colocar en boca de salida de extractor de aire 4&quot; (EBG 4&quot;) / 10 cm</span><br />\n<span style=\"background-color:transparent\">- Medidas: 18 x 18 cm</span><br />\n<span style=\"background-color:transparent\">- Di&aacute;metro boca: 15 cm.</span></span></span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"color:#000000\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:14px\"><span style=\"background-color:transparent\">- 1 A&Ntilde;O DE GARANT&Iacute;A</span></span></span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"color:#000000\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:14px\"><span style=\"background-color:transparent\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES (SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O):</span><span style=\"background-color:transparent\"> CABA / ROSARIO / SAN FRANCISCO&nbsp;</span></span></span></span></p>\n", "21", "12", "ARS", "1640", "0", "10", "archivos/productos/recortadas/a_a7aacf.jpg", "archivos/productos/recortadas/a_d902b3.png", "archivos/productos/recortadas/a_24d2cd.jpg", "archivos/productos/recortadas/a_493f0f.jpg", "archivos/productos/recortadas/a_27dde2.jpg", "0", "1", "0000-00-00", "1.5", "", "", ""); 
INSERT INTO `portfolio` VALUES("239", "VCU 2E 140 X 60", "VENTILADOR CENTRÍFUGO VCU 2E 140 X 60", "<p><em><strong>MODELO: VENTILADOR CENTRIFUGO VCU 2E 140 X 60&nbsp;</strong></em><br />\n-&nbsp;Dise&ntilde;ado para el suministro y ventilaci&oacute;n de escape de varios locales. El ventilador se puede utilizar como un componente para los sistemas de ventilaci&oacute;n y aire acondicionado y es adecuado para el montaje exterior.<br />\n-&nbsp;<em>Motor:</em> adoptado por motor de rotor externo as&iacute;ncrono de una sola frase.<br />\n-&nbsp;<em>Rotor: </em>el impulsor con curva hacia atr&aacute;s se combina bien con la carcasa de metal para maximizar el ujo de aire y la eciencia, y para minimizar el nivel de ruido<br />\n-&nbsp;<em>Carcasa de metal:</em> acero de laminaci&oacute;n en fr&iacute;o de estiramiento profundo de calidad. La supercie pintada por pulverizaci&oacute;n tiene una fuerte resistencia a la oxidaci&oacute;n.<br />\n-&nbsp;<em>Caja de alimentaci&oacute;n:</em> de metal. Calidad a prueba de fuego, seguridad para el uso. Y f&aacute;cil de desmontar.<br />\n-&nbsp;Es ampliamente utilizado en hoteles, auditorios, estaciones, supermercados, aeropuertos y otras ocasiones p&uacute;blicas.<br />\n-&nbsp;<em>Montaje:</em> el ventilador es adecuado para su instalaci&oacute;n en ventilaci&oacute;n. C&aacute;maras, unidades de aire acondicionado o pueden ser utilizadas individualmente.<br />\n- Voltaje: 230 V<br />\n- Corriente: 0,64 A<br />\n- Caudal m&aacute;ximo de aire: 515 M3 x H.<br />\n- RPM: 2820<br />\n- Potencia: 148&nbsp;W<br />\n- Nivel sonoro: 68 dBA<br />\n- Peso: 3,700 Kgs</p>\n\n<p>- 1 A&Ntilde;O DE GARANT&Iacute;A</p>\n\n<p>* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES (SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O): CABA / ROSARIO / SAN FRANCISCO&nbsp;</p>\n", "LÍNEA INDUSTRIAL ", "VENTILADORES ", "ARS", "9700", "0", "4", "archivos/productos/recortadas/a_013589.png", "archivos/productos/recortadas/a_d48a35.07", "", "", "", "0", "1", "0000-00-00", "3.5", "archivos/productos/pdf/4bb654.pdf", "", ""); 


DROP TABLE IF EXISTS `productos`;
CREATE TABLE `productos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cod` varchar(255) DEFAULT NULL,
  `titulo` text,
  `precio` float DEFAULT NULL,
  `precio_descuento` float DEFAULT NULL,
  `stock` int(11) DEFAULT '0',
  `desarrollo` text,
  `categoria` text,
  `subcategoria` text,
  `keywords` text,
  `description` text,
  `variable1` text COMMENT 'estado: 0-Activo 1-Inactivo',
  `variable2` text COMMENT 'tipo: 1-Tienda 0-Productos',
  `variable3` text,
  `variable4` text COMMENT 'peso',
  `variable5` text COMMENT 'altura',
  `variable6` text COMMENT 'ancho',
  `variable7` text COMMENT 'profundidad',
  `variable8` text COMMENT 'imagenes de la pagina vieja',
  `variable9` text COMMENT 'video',
  `variable10` text,
  `fecha` date DEFAULT NULL,
  `meli` varchar(255) DEFAULT NULL,
  `url` text,
  `cod_producto` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=199 DEFAULT CHARSET=latin1;

