INSERT INTO `productos` VALUES("17", "5f16d77052", "EXTRACTOR DE AIRE SEMI INDUSTRIAL 40 CM PARA PARED BAÑO/COCINA", "4990", "0", "2", "<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong><span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- MODELO: CENTURY 400</span></strong><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Ventilador axial para montar en la pared</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- De gran caudal y bajas presiones. Para trabajar en un rango de temperatura&nbsp; entre 0&deg; y 40&deg;C.</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Fabricado en:&nbsp;h&eacute;lice de chapa acero SAE 1010, aro repujado con doble brida de chapa acero SAE 1010.</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Apto para uso permanente hasta 8 horas continuas</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Caudal: 1800 m3 x hora</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Potencia: 1/25 HP</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Nivel sonoro:&nbsp;71,5 dBA</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Medidas:&nbsp;86,85&nbsp;mm de alto x&nbsp;97&nbsp;mm de base x&nbsp;402,4 mm de di&aacute;metro.</span><br />\n<br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- 1 A&Ntilde;O DE GARANT&Igrave;A</span></span></span></p>\n\n<p><span style=\"background-color:transparent; color:#000000; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif; font-size:14px\">ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES (SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O):</span><span style=\"background-color:transparent; color:#000000; font-family:sans-serif,Arial,Verdana,&quot;Trebuchet MS&quot;; font-size:13.33px\"> CABA / ROSARIO / SAN FRANCISCO&nbsp;</span></p>\n", "eed3230232", "8b2ec1da68", "", "", "0", "1", "", "6.2", "", "", "", "a_9c3292.jpg///a_04450e.jpg///a_d9d46f.jpg", "", "", "2017-01-24", "", "", "CENTURY 400 C "); 
INSERT INTO `productos` VALUES("18", "55da673c0d", "SERIE K", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>La serie &quot;K&quot; est&aacute; especialmente dise&ntilde;ada para aplicaciones industriales, bajo condiciones de servicio severas y permanentes, en ambientes con alto porcentaje de humedad relativa y temperaturas que van de 25&ordm;C a 40&ordm;C (Ejecuci&oacute;n 1); y hasta 80&ordm;C (Ejecuci&oacute;n 2); pueden trabajar vertical u horizontalmente. Cubren una gama de caudales que van desde: 360m3/h hasta 64.800m3/h. Se producen con &aacute;labes de polipropileno y fibra de vidrio, y a pedido en aluminio.</p>\n\n<p>APLICACIONES</p>\n\n<p>En cabinas de pintura, secadores, c&aacute;maras frigor&iacute;ficas, cortinas de aire, torres de enfriamiento, tuber&iacute;as y filtros con p&eacute;rdidas moderadas de presi&oacute;n, etc.</p>\n", "e93de1739c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_d45f38.png///a_3d54d6.JPG///a_c8cc15.JPG///a_972527.jpg", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("19", "52f0613f54", "SERIE W", "0", "0", "100", "<p>GENERALIDAD</p>\n\n<p>La serie &quot;W&quot; est&aacute; especialmente dise&ntilde;ada para trabajar en instalaciones de ventilaci&oacute;n o extracci&oacute;n de aire, donde se requieren grandes caudales con bajas perdidas de presi&oacute;n. Pueden trabajar vertical u horizontalmente; todos los modelos se construyen para dos velocidades de giro, cubriendo un amplio rango de caudales que van desde los 720m3/h hasta los 79.200m3/h, con temperaturas de aire de hasta 40&ordm;C. Se fabrican con &aacute;labes de polipropileno y fibra de vidrio, y a pedido en chapa SAE 1010.</p>\n\n<p>APLICACIONES</p>\n\n<p>Ventilaci&oacute;n o extracci&oacute;n de aire en f&aacute;bricas, salas de reuni&oacute;n, ba&ntilde;os, criaderos de aves, y en general donde deseen eliminar olores, humos y vapores.</p>\n", "e93de1739c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_0e40b9.jpg", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("20", "29ea661797", "SERIE WH/KH", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Los ventiladores para instalaci&oacute;n sobre techos, permiten resolver problemas tales como la localizaci&oacute;n de aspiraciones, barridos uniformes de aire, variedad de posibilidades en la ubicaci&oacute;n de las unidades extractoras, etc. La condici&oacute;n normal de funcionamiento es la extracci&oacute;n de aire; invirtiendo el sentido de rotaci&oacute;n es posible inyectar aire al local, pero en ese caso el caudal volum&eacute;trico disminuye en un 25 a 30%. Los di&aacute;metros de h&eacute;lice van de 350mm, hasta 850mm; lo que sumado a las velocidades de rotaci&oacute;n disponibles permite cubrir una gama de caudales que van de 1800m3/h hasta los 35.000m3/h.</p>\n\n<p>APLICACIONES</p>\n\n<p>Estos ventiladores tienen especial aplicaci&oacute;n en medianos y grandes ambiente, pudiendo con los mismos evitar la instalaci&oacute;n en paredes medianeras.</p>\n", "e93de1739c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_2e8f83.png///a_90cf06.jpg///a_e7f074.jpg", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("21", "5c335814c2", "SERIE KE", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>La serie KE est&aacute; especialmente dise&ntilde;ada para aplicaciones industriales, bajo condiciones de servicio severas y permanentes, en ambientes con altos porcentajes de humedad relativa y temperaturas que van de - 25&ordm;C&nbsp; hasta 80&ordm;C ; pueden trabajar vertical u horizontalmente. Cubren una gama de caudales desde 1 m3/s,&nbsp; y presiones de hasta 100 mm</p>\n\n<p>APLICACIONES</p>\n\n<p>Aplicables en cabinas de pintura, secaderos, c&aacute;maras frigor&iacute;ficas, cortinas de aire, torres de enfriamiento, tuber&iacute;as y filtros con p&eacute;rdidas moderadas de presi&oacute;n, etc.</p>\n", "e93de1739c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_3960c6.png", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("22", "52d3fe1ed1", "SERIE KP/WP ", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Los ventiladores axiales y helicoidales de &eacute;sta l&iacute;nea est&aacute;n fabricados enteramente en polipropileno y fibra de vidrio, anticorrosivo y antichispas. De aro cuadrado en 3 tama&ntilde;os: 350, 450 y 550mm, pueden fabricarse con h&eacute;lices axiales o helicoidales. Soportan f&aacute;cilmente condiciones de servicio severas.</p>\n\n<p>APLICACIONES</p>\n\n<p>Para aplicar en c&aacute;maras frigor&iacute;ficas, cortinas de aire, torres de enfriamiento, tuber&iacute;as, filtros, en f&aacute;bricas, salas de reuni&oacute;n, ba&ntilde;os, criadores de aves y en general para extraer humos y vapores</p>\n\n<p>&nbsp;</p>\n", "e93de1739c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_2a2bec.JPG///a_a65223.jpg///a_ab963d.JPG///a_9ff982.JPG", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("23", "262c79dcbf", "EÓLICOS", "0", "0", "100", "<p>GENERALIDAD</p>\n\n<p>Este tipo de extractor tiene la capacidad de extraer humos, gases, polvo y olores las 24 horas del d&iacute;a, rotando por la acci&oacute;n del viento o por diferencia de temperatura ambiente, sin producir ruidos. Su construcci&oacute;n sin motor no produce ning&uacute;n gasto energ&eacute;tico, y hace que no requiera mantenimiento. La alternativa de construcci&oacute;n con motor el&eacute;ctrico de bajo consumo, montado sobre rodamientos blindados y autolubricados permiten aumentar su capacidad de extracci&oacute;n cuando sea necesario.</p>\n\n<p>APLICACIONES</p>\n\n<p>Ideal para industrias, silos, galpones,dep&oacute;sitos, clubes, escuelas, supermercados,polideportivos, hangares, etc.</p>\n", "e93de1739c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_23b3ae.jpg///a_f4c6de.jpg///a_1e3453.jpg///a_40ae41.jpg///a_6af84f.jpg", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("24", "44fc46d0fe", "HÉLICES AXIALES", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>H&eacute;lices Axiales de &aacute;ngulo variable Di&aacute;metro de 300 a 1210 mm. Se fabrican en polipropileno y fibra de vidrio o en aluminio. Caudal: hasta 90.000m3/h. Presi&oacute;n: hasta 500Pa. H&eacute;lices Helicoidales de &aacute;ngulo variable Di&aacute;metro de 350 a 1440mm. Caudal: hasta 105.000m3/h. Presi&oacute;n: hasta 250 Pa.</p>\n\n<p>APLICACIONES</p>\n\n<p>Cabinas de pintura secaderos de madera, ventilaci&oacute;n industrial y agr&iacute;cola, refrigeradores, evaporadores, atomizadores para el campo, secadoras de grano, aireaci&oacute;n de silos, torres de enfriamiento,etc.</p>\n", "e93de1739c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_3fba68.JPG///a_e93f1a.JPG///a_b8a72f.JPG///a_77f78c.JPG", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("25", "fd2341a665", "SERIE WF", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>La L&iacute;nea de Circuladores WF, desarrollados por Gatti S.A, est&aacute;n especialmente dise&ntilde;ados para proporcionar el m&aacute;ximo caudal de aire con el mayor alcance posible, manteniendo un Nivel sonoro bajo en condiciones de baja contrapresi&oacute;n. Su dise&ntilde;o de H&eacute;lice y la versatilidad de Montaje lo hacen apto para aplicaciones especificas donde son necesarias una adecuada corriente de aire en cuanto a uniformidad y alcance.</p>\n\n<p>APLICACIONES</p>\n\n<p>Ventiladores tipo circuladores de aire para refrigeraci&oacute;n transformadores.</p>\n", "e93de1739c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_9150e4.jpg///a_4e0643.jpg///a_8d5a06.jpg", "wEvWNE9PUiM", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("26", "48075888e4", "RA /RB /RG /RH / RD/ RE", "0", "0", "1000", "<p>GENERALIDADES</p>\n\n<p>Rotor multipala SIROCCO Para aire limpio y humos. Aplicables en acondicionamiento de aire, sistema de ventilaci&oacute;n, etc. Simple boca de aspiraci&oacute;n. Caudales: hasta 10.200m3/h. Presiones: hasta 4050 Pa. Pantalla abierta RADIAL Para aire sucio, con material filamentoso o granular en suspensi&oacute;n.</p>\n\n<p>APLICACIONES</p>\n\n<p>Aplicables en transporte neum&aacute;tico de no abrasivos, aspiraci&oacute;n localizada de polvos en m&aacute;quinas. Simple boca de aspiraci&oacute;n. Caudales: hasta 8.400 m3/h Presiones: hasta 1700 Pa.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n", "7f68015e9c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_5468a0.jpg///a_cf08b8.jpg///a_689c5f.jpg///a_327cce.jpg", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("27", "b930c85355", "CA DADE", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Para aire limpio y humo. Aplicable en acondicionamiento de aire, sistema de ventilaci&oacute;n, etc. Simple boca de aspiraci&oacute;n. De formato cuadrado, para intercalar entre conductos. Caudales: hasta 2500m3/h. Presiones: hasta 100mm c.a.</p>\n\n<p>APLICACIONES</p>\n\n<p>Estos ventiladores centr&iacute;fugos est&aacute;n proyectados para su aplicaci&oacute;n en movimiento de aire de baja y media presi&oacute;n a una temperatura m&aacute;xima de 50&ordm;C. Caracol construido en chapa de acero com&uacute;n o chapa galvanizada</p>\n", "7f68015e9c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_668a8d.JPG///a_f68b1a.JPG///a_b19191.JPG", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("28", "dc1532d697", "RU EN LÍNEA", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Los ventiladores centr&iacute;fugos de esta serie son particularmente aptos para mover aire limpio en el campo de las aplicaciones industriales y agrarias. La variedad de tama&ntilde;os disponibles permite obtener caudales de hasta 23.400 m3/h, presiones de hasta 300mm H2O y temperaturas de hasta 300&ordm;C.</p>\n\n<p>APLICACIONES</p>\n\n<p>En general en todas las instalaciones de acondicionamiento industrial y del agro (desecaci&oacute;n de forrajes y cereales, eliminaci&oacute;n de humos y vapores, aireaci&oacute;n de silos, ventilaci&oacute;n de minas y galer&iacute;as, secado de papel, pasta, etc)</p>\n", "7f68015e9c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_8ceb50.JPG///a_10fe1f.JPG///a_c4c4f7.JPG///a_6e137b.JPG", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("29", "19ad1f690f", "RM", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Los ventiladores centr&iacute;fugos de la serie RM son particularmente aptos para mover aire en el campo de las aplicaciones agroindustriales. La variedad de tama&ntilde;os disponibles permite obtener caudales de hasta 93000 m3/h (26 m3/s) y presiones de 790 mmca (7700 Pa). Apto para transportar aire levemente polvoriento o sucio. Usos en industrias mec&aacute;nicas, f&aacute;bricas de cemento, curtidos, altos hornos, en la industria de molienda, mesas de corte de plasma, etc. Ventiladores constru&iacute;dos en acero SAE 1010, solo disponibles en versiones SASE, boca de aspiraci&oacute;n c&oacute;nica con resalto para flexible. Los rotores son de alabes planos inclinados hacia atr&aacute;s en dos formatos constructivos.</p>\n\n<p>APLICACIONES</p>\n\n<p>Apto para transportar aire levemente polvoriento o sucio, no Apto para material abrasivo. Ideal donde se necesite presiones relativamente altas con bajo nivel sonoro. Usos en industrias mec&aacute;nicas, f&aacute;bricas de cemento, curtidos, altos hornos, en la industria de molienda, mesas de corte de plasma, en todas las aplicaciones donde se requiere transportar aire mesclado con materiales peque&ntilde;os con baja y media presi&oacute;n.</p>\n", "7f68015e9c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_a76bdf.JPG///a_1d5f39.JPG///a_5e5861.JPG///a_9ca8fd.jpg///a_66c08a.png", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("30", "6901fd927a", "CA CB EN LÍNEA", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Para aire limpio y humo. Aplicable en acondicionamiento de aire, sistema de ventilaci&oacute;n, etc. Simple boca de aspiraci&oacute;n. De formato cuadrado, para intercalar entre conductos. Caudales: hasta 2500m3/h. Presiones: hasta 100mm c.a.</p>\n\n<p>APLICACIONES</p>\n\n<p>Estos ventiladores centr&iacute;fugos est&aacute;n proyectados para su aplicaci&oacute;n en movimiento de aire de baja y media presi&oacute;n a una temperatura m&aacute;xima de 50&ordm;C. Caracol construido en chapa de acero com&uacute;n o chapa galvanizada.</p>\n", "7f68015e9c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_88661b.jpg///a_3562c3.jpg", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("31", "51d4057c84", "UH - TORRE DE EXTRACCIÓN ", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>La L&iacute;nea de extractores UH de descarga vertical, est&aacute; especialmente dise&ntilde;ada para usos comerciales e industriales. Se fabrican en una variedad de tama&ntilde;os y modelos que permiten un rango de caudal de 850 hasta 8700 m3/h.&nbsp;</p>\n\n<p>APLICACIONES</p>\n\n<p>Dise&ntilde;ado para extracci&oacute;n de aire, para aplicaci&oacute;n sobre techos o al final de conductos, para campanas de cocina o en sistemas de extracci&oacute;n de aire en general, donde se necesite una descarga vertical del aire y menor nivel sonoro.</p>\n", "7f68015e9c", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_d0f614.png///a_9d4832.JPG///a_945d25.JPG", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("32", "e37ba91d3c", "SILVY", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>De formato redondo y cuadrado, poseen una amplia gama de aplicaciones, ya sea impulsando o extrayendo aire. Aplicables para reducir la temperatura y la humedad. Son de funcionamiento silencio. Producen una correcta renovaci&oacute;n del aire eliminando la condensaci&oacute;n, y necesitan un m&iacute;nimo de mantenimiento.</p>\n\n<p>APLICACIONES</p>\n\n<p>Son aplicables a granjas av&iacute;colas, criadores de cerdos, invernaderos, cabinas de secado (cueros, maderas, etc), grandes dep&oacute;sitos de frutas y hortalizas.</p>\n", "06aaaafbc2", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_640123.jpg///a_c8eac9.jpg", "", "", "2017-01-26", "", "", "0"); 
INSERT INTO `productos` VALUES("33", "3e42904cf7", "FABY HOGAR - PIE Y PARED", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Este ventilador es particularmente indicado para peque&ntilde;os y medianos ambientes, tales como comercio, comedores,&nbsp;hogares, oficinas, gimnasios, etc.&nbsp;Remueve un importante volumen de aire produciendo un efecto placentero de refrigeraci&oacute;n en una vasta zona circundante. Tiene alcance de 20 mts. de distancia. Se construyen con &aacute;labes de chapa de aluminio. Se presenta en 3 modelos: 16&quot;, 20&quot; y 25&quot;.</p>\n\n<p>APLICACIONES</p>\n\n<p>Este ventilador es particularmente indicado para medianos y grandes ambientes, tales como comercios, comedores, instruias, etc. Remueve un importante volumen de aire produciendo un efecto placentero de refrigeraci&oacute;n en una vasta zona circundante</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n", "06aaaafbc2", "8b2ec1da68", "", "", "0", "0", "", "0", "", "", "", "a_f20c90.png///a_1355fe.jpg///a_8a1ee6.jpg///a_c6362c.JPG///a_e9c21d.jpg", "", "", "2017-01-26", "", "", "0"); 
