INSERT INTO `productos` VALUES("39", "962e035ce1", "VENTILADOR INDUSTRIAL FABY - PIE Y PARED", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Este ventilador es particularmente indicado para medianos y grandes ambientes, tales como industrias, galpones, gimnasios, etc. Remueve un importante volumen de aire produciendo un efecto placentero de refrigeraci&oacute;n en una vasta zona circundante.<br />\nMotos de 2 velocidades con un alcance m&agrave;ximo de 18 mts de distancia.<br />\nSe construyen con &aacute;labes polipropileno y fibra de vidrio en sus dos versiones: ventilador de pie / pared, monof&agrave;sico o trif&agrave;sico.</p>\n\n<p>APLICACIONES</p>\n\n<p>Para remover el aire en medianos y grandes ambientes como industrias, galpones, gimnasios, etc.</p>\n", "06aaaafbc2", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_ac4c53.jpg///a_1fcaa8.jpg///a_204609.jpg///a_ed2584.jpg///a_ff005b.jpg", "RN9vY8QehsQ", "", "2017-01-31", "", "", "0"); 
INSERT INTO `productos` VALUES("40", "4623bcd20d", "VPK", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Estos ventiladores fueron dise&ntilde;ados especialmente para lograr temperatura y humedad adecuadas en lugares de trabajo como: acer&iacute;as, f&aacute;bricas de vidrios, discos para agricultura, fundiciones y talleres de tratamiento t&eacute;rmico.</p>\n\n<p>APLICACIONES</p>\n\n<p>Mediante el agregado de agua pulverizada es posible lograr un enfriamiento adicional. Tambi&eacute;n se emplean en el desplazamiento de humos, dispersi&oacute;n de polvos finos y procesos de secado. Caudales: hasta 35.000 m3/h.</p>\n", "06aaaafbc2", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_1a686c.png", "", "", "2017-01-31", "", "", "0"); 
INSERT INTO `productos` VALUES("41", "b9f2db89a9", "CORTINAS DE AIRE", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>L&iacute;nea comercial e industrial, montada totalmente sobre rodamientos, turbina de aluminio, balanceada est&aacute;ticamente y din&aacute;micamente. Genera una poderosa pared de aire que impide que el flujo de aire caliente o fr&iacute;o pase de un ambiente a otro. Adem&aacute;s no permite el paso de insectos, polvo, olor, humedad y otros contaminantes. A pedido se proveen m&oacute;dulos de calor (resistencias).&nbsp;&nbsp;&nbsp;</p>\n\n<p>APLICACIONES</p>\n\n<p>Los tres modelos de cortinas de aire permiten su uso en un amplio rango aberturas y tipo de instalaciones con y sin calor como ser: Centros Comerciales, Farmacias, Laboratorios, ambientes industriales, C&aacute;maras Frigor&iacute;ficas, ambientes presurizados etc.</p>\n", "fcc1569a20", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_ab9058.jpg///a_a0ca45.jpg///a_bdc019.jpg///a_cd8930.jpg///a_c70a90.jpg", "", "", "2017-01-31", "", "", "0"); 
INSERT INTO `productos` VALUES("42", "fa768e7b51", "EXTRACTOR DE AIRE BAÑO EBG", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Dise&ntilde;ados para renovar el aire contaminado o h&uacute;medo en peque&ntilde;as habitaciones, ba&ntilde;os, oficinas y locales. Se trata de un peque&ntilde;o extractor fabricado en material termopl&aacute;stico ABS, de formato est&eacute;tico, delgado y silencioso.&nbsp;&nbsp;&nbsp;</p>\n\n<p>APLICACIONES</p>\n\n<p>Aplicable en ba&ntilde;os y lugares de poco volumen donde se necesita renovar el aire contaminado. Es de f&aacute;cil instalaci&oacute;n en paredes y techos.</p>\n", "61e82f4be2", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_14c014.jpg///a_bb0def.JPG///a_7057b3.jpg///a_65f934.jpg", "", "", "2017-01-31", "", "", "0"); 
INSERT INTO `productos` VALUES("43", "1d0801c6e7", "EXTRACTOR DE AIRE CAMPANITA / TUBULAR", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Modelo 100/150/250/150AT/250AT Este ventilador centr&iacute;fugo-radial modelo Campanita, fue especialmente dise&ntilde;ado para la extracci&oacute;n de aire en extremos de conductos, entregando gran caudal, bajo consumo, bajo nivel sonoro y no necesitan de mantenimiento. Modelo 100: aplicaci&oacute;n en campana de cocina, ba&ntilde;os, etc. Modelo 150AT 250AT (alta temperatura): aplicaci&oacute;n en estufas, asadores, etc.</p>\n\n<p>APLICACIONES</p>\n\n<p>Este ventilador centr&iacute;fugo modelo Tubular en l&iacute;nea posee una gran gama de aplicaciones, al inicio de un conducto, o montado en la campana de cocina.</p>\n", "61e82f4be2", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_909a73.jpg///a_90dc16.jpg///a_60df06.jpg///a_f0b5ff.jpg", "", "", "2017-01-31", "", "", "0"); 
INSERT INTO `productos` VALUES("44", "4c9ccdb5f9", "VENTILADOR DE TECHO CHAPA -  CLÁSICO ", "0", "0", "100", "<p>- MODELO: VENTILADOR CL&Aacute;SICO</p>\n\n<p>GENERALIDADES</p>\n\n<p>Ventilador de techo de chapa de 120 cm de di&aacute;metro. Fabricado en 2 colores: negro o blanco.</p>\n\n<p>Todos nuestros ventiladores de techo son silenciosos y de f&aacute;cil instalaci&oacute;n. Poseen motor a rodamientos de bajo consumo y garant&iacute;a de 1 a&ntilde;o. Para uso dom&eacute;stico, comercial e industrial.</p>\n\n<p>- Motor de bajo consumo. Permite un uso continuo del aparato sin levantar temperatura que afecte sus componentes vitales.<br />\n- Compatibles con artefactos de iluminaci&oacute;n (Luminaria).<br />\n- Caja selectora de 5 velocidades.</p>\n\n<p>APLICACIONES</p>\n\n<p>En hogares, oficinas, locales comerciales, departamentos, etc.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n", "61e82f4be2", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_04b2a8.jpg///a_459f13.jpg///a_6f5274.jpg///a_87e802.jpg", "", "", "2017-01-31", "", "", "VTCLASICO"); 
INSERT INTO `productos` VALUES("45", "d176fa51ff", "EXTRACTOR DE AIRE CENTURY - HOGAR / COMERCIAL ", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Ventilador Axial para montar en pared . En el dise&ntilde;o del mismo se ha procurado la construcci&oacute;n de una unidad s&oacute;lida, compacta y chata. De gran caudal y bajas presiones, para trabajar en un rango de temperaturas que oscila entre 0oC y 40oC tanto para la Serie Comercial como para la Serie Hogar.</p>\n\n<p>APLICACIONES</p>\n\n<p>Se trata de un equipo apto para servicios continuos en condiciones exigentes. Aplicados en locales comerciales, auditorios grandes, entre otros.<br />\n&nbsp;<br />\n&nbsp;</p>\n", "61e82f4be2", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_181200.jpg///a_2576a7.jpg///a_641667.jpg///a_287343.jpg", "", "", "2017-01-31", "", "", "0"); 
INSERT INTO `productos` VALUES("46", "001a3887af", "VPK 1000", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Es el equipo ideal para la dif&iacute;cil tarea de controlar las grandes emanaciones de polvo de la industria. Est&aacute; dise&ntilde;ado para producir una pulverizaci&oacute;n sumamente fina, especial para poder capturar el polvo del ambiente y de esta manera limpieza y mejorar la calidad del aire de su industria. El sencillo principio del funcionamiento del VPK 100 hace que su mantenimiento y operaci&oacute;n sean aptos para cualquier tipo de personal. Su construcci&oacute;n es sumamente robusta y los elementos que lo componen son de primera calidad internacional, por esto puede trabajar en los ambientes industriales m&aacute;s hostiles.<br />\n&quot;Comercializado por Sprytec&quot;&nbsp;&nbsp;&nbsp;</p>\n\n<p>APLICACIONES</p>\n\n<p>Especialmente dise&ntilde;ado para atenuar polvo en suspensi&oacute;n de aire, como aplicaciones mineras o demoliciones de edificaciones, etc.</p>\n\n<p>&nbsp;</p>\n", "6d818d6604", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_20fadc.png///a_503b46.jpg", "CFi6wT4XbMw", "", "2017-02-01", "", "", "0"); 
INSERT INTO `productos` VALUES("47", "7fbb976797", "KU 765", "0", "0", "100", "<p>GENERALIDADES Y APLICACIONES</p>\n\n<p>Ventilador axial, de salida radial para fumigaci&oacute;n m&oacute;vil, accionado con sistema de transmisi&oacute;n a multiplicaci&oacute;n y conectado a toma de fuerza de tractor para grandes valores de rpm, lo que permite altos valores de caudal y poder romper las gotas de agua y alcanzar grandes distancias. Su f&aacute;cil manejo e instalaci&oacute;n as&iacute; como su bajo mantenimiento lo hace un equipo ideal para aplicaciones frutiorticolas. Utilizados en equipos de fumigaci&oacute;n tipo Atomizadores y Pulverizadores.</p>\n", "6d818d6604", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_a67b98.jpg///a_afc2f5.jpg///a_b3b76d.JPG///a_890979.JPG", "fTTQOhuQtBE", "", "2017-02-01", "", "", "0"); 
INSERT INTO `productos` VALUES("48", "f0a4d8bdef", "RB 420", "0", "0", "100", "<p>GENERALIDADES Y APLICACIONES</p>\n\n<p>Ventilador Centr&iacute;fugo de construcci&oacute;n especial, construida en chapa SAE 1010. Formato a transmisi&oacute;n con Punta de eje libre y Clapeta de regulaci&oacute;n de aire a la Salida, con rejilla de protecci&oacute;n en la boca de aspiraci&oacute;n lo que evita tambi&eacute;n el ingreso de cuerpos extra&ntilde;os al rotor. Especialmente dise&ntilde;ado para los sistema s de transporte de semilla de Maquinas Sembradora / Fertilizadora de Grano fino para siembra directa</p>\n\n<p>&nbsp;</p>\n", "6d818d6604", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_7c14f5.jpg///a_d8c92d.JPG", "", "", "2017-02-01", "", "", "0"); 
INSERT INTO `productos` VALUES("49", "a8e6eacdb5", "BRAZOS ARTICULADOS", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Es un equipo vers&aacute;til de optima apariencia, f&aacute;cil de limpiar y maniobrable. Puede ser definido como una flexible y eficiente toma articulada para el control directo sobre la fuente de emisi&oacute;n de polvos, humo de soldadur,a niebla de aceite, vapor de solvente. Su funci&oacute;n es optimizar la captura localizada de contaminantes, tanto externas como internas, para lograr su amplio espectro de movimiento y rotaci&oacute;n. La articulaciones externas pueden ser ajustadas manualmente, sin utilizar herramientas especiales.</p>\n\n<p>APLICACIONES</p>\n\n<p>Se utiliza para la aspiraci&oacute;n localizada de polvos, en el control de humos y vapores, durante operaciones de corte con plasma y soldadura, aspiraci&oacute;n de vapores y gases durante el trasvase de solventes, combustibles y control de nieblas de aciete refrigerantes en operaciones de mecanizad, entre otras. &nbsp;&nbsp;</p>\n", "c31e9829ae", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_a2c7a5.jpg///a_028d7c.jpg///a_cf3987.jpg", "", "", "2017-02-01", "", "", "0"); 
INSERT INTO `productos` VALUES("50", "c013f6db44", "PERSIANA POR GRAVEDAD", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Este accesorio se utiliza para impedir el paso de insectos, polvo u otros elementos o part&iacute;culas del aire, y de la lluvia en el interior del recinto, en el momento en que el ventilador no se encuentra en funcionamiento. Funciona por gravedad, abri&eacute;ndose y cerr&aacute;ndose con el paso del aire durante el funcionamiento del ventilador, y se mantiene cerrada cuando este est&aacute; apagado. Los modelos de 450 a 1000 a pedido tambi&eacute;n pueden fabricarse fijas a 45&ordm;.</p>\n\n<p>APLICACIONES</p>\n\n<p>Los modelos 200 a 400 se fabrican en alto impacto con UV que la protege de los da&ntilde;os solares, y desde el 450 al 1000 en chapa galvanizada, por lo que es anticorrosiva.</p>\n", "c31e9829ae", "cbf69f7265", "", "", "0", "0", "", "0", "", "", "", "a_faee7b.png///a_58ce45.jpg///a_4f8c74.jpg///a_f8efb1.jpg", "", "", "2017-02-01", "", "", "0"); 
