INSERT INTO `productos` VALUES("59", "e9ebad6b72", "VENTILADOR SEMI INDUSTRIAL DE PIE 25", "4990", "0", "2", "<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>- MODELO: FABY PIE&nbsp;25&quot;</strong><br />\n-&nbsp; Color: gris plata<br />\n- Ventilador oscilante o fijo<br />\n- Caja selectora de 3 velocidades<br />\n- Tripala de aluminio pintada<br />\n- Cubre motor met&aacute;lico<br />\n- Base redonda met&aacute;lica<br />\n- Motor con buje de bronce<br />\n- Coronas de movimiento de bronce<br />\n- H&eacute;lice met&aacute;lica<br />\n- Potencia: 110 W<br />\n- Di&aacute;metro: 635 mm<br />\n- Alcance m&aacute;ximo: 6 mts.<br />\n- Alcance m&iacute;nimo: 3 mts.<br />\n- Medidas: 1,60 alto x 0,35 profundidad x 0,60 mts di&aacute;metro base<br />\n- Producto 100% nacional, primera calidad</span></span></p>\n\n<p><br />\n- 1 A&Ntilde;O DE GARANT&Igrave;A</p>\n\n<p><span style=\"background-color:transparent; color:#000000; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif; font-size:14px\">ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES (SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O):</span><span style=\"background-color:transparent; color:#000000; font-family:sans-serif,Arial,Verdana,\"> CABA / ROSARIO / SAN FRANCISCO&nbsp;</span><br />\n&nbsp;</p>\n", "a45ed48c22", "cbf69f7265", "", "", "0", "1", "", "16.5", "", "", "", "a_e12004.jpg///a_58f60a.jpg///a_9fb7fe.jpg///a_f92586.jpg", "ZbGqS8bw-M8", "", "0000-00-00", "", "", "FABY 25 PIE"); 
INSERT INTO `productos` VALUES("60", "ad132d5edf", "SPLIT NEXGEN SMART CARRIER 2250 Kcal - FRIO/CALOR", "15140", "15500", "0", "<p>MARCA: Carrier&nbsp;2250 Kcal FR&Iacute;O CALOR<br />\n- Modelo: 53CNG0921F<br />\n- Origen: Argentina</p>\n\n<p><strong>CARACTER&Iacute;SITICAS DEL EQUIPO</strong><br />\n-Frigor&iacute;as: 2550<br />\n-Eficiencia energ&eacute;tica frio: A<br />\n-Eficiencia energ&eacute;tica calor: C</p>\n\n<p>- Consumo el&eacute;ctrico: Refrigeraci&oacute;n 0.80 KW / Calefacci&oacute;n 0.79 KW</p>\n\n<p>- Corriente: Refrigeraci&oacute;n A 3.77 / Calefacci&oacute;n A 3.65</p>\n\n<p>- Dimensiones unidad interior: 300 x 725 x 185 mm.</p>\n\n<p>- Dimensiones unidad exterior: 560 x 765 x 300 mm</p>\n\n<p>- Garant&iacute;a: 3 a&ntilde;os directo de f&aacute;brica</p>\n\n<p>- Nexgen cuenta con tecnolog&iacute;a innovadora que te permite llevar tu experiencia de confort a otro nivel. Mediante la App Carrier Air Conditioner pod&eacute;s controlar tu equipo de manera remota desde tu smartphone o tablet.<br />\n<br />\n<strong>ECOL&Oacute;GICO Y SALUDABLE</strong><br />\nAire m&aacute;s limpio y saludable<br />\n<br />\n<strong>SONORIDAD</strong><br />\nMenor nivel sonoro<br />\n<br />\n<strong>FUNCI&Oacute;N MODO SLEEP</strong><br />\nRegula la temperatura durante las horas de sue&ntilde;o, al refrigerar o calefaccionar el ambiente.<br />\n<br />\n<strong>FUNCI&Oacute;N MODO AIRFLOW</strong><br />\nDistribuci&oacute;n pareja del aire en el ambiente por control del &aacute;ngulo de oscilaci&oacute;n.<br />\n<br />\n<strong>FUNCI&Oacute;N FOLLOW ME</strong><br />\nControla la temperatura del ambiente bas&aacute;ndose tambi&eacute;n en la temperatura alrededor del control remoto.<br />\n<br />\n<strong>DETECCI&Oacute;N P&Eacute;RDIDA DE REFRIGERANTE</strong><br />\nSi el equipo detecta la p&eacute;rdida de refrigerante, se activa el aviso l&uacute;m&iacute;nico en el display.<br />\n<br />\n<strong>FUNCI&Oacute;N AUTO LIMPIEZA</strong><br />\nLa funci&oacute;n ?Self Clean? seca la unidad interior por dentro evitando la formaci&oacute;n de moho.<br />\n<br />\n<strong>REENCENDIDO AUTOM&Aacute;TICO</strong><br />\nLuego de un corte de energ&iacute;a el equipo se reinicia en la &uacute;ltima temperatura seteada.<br />\n<br />\n<strong>FUNCI&Oacute;N MODO SWING</strong><br />\nFunci&oacute;n Modo swing<br />\n<br />\n<strong>FUNCI&Oacute;N MODO TURBO</strong><br />\nFunci&oacute;n Modo turbo<br />\n<br />\n<strong>SMART COMFORT</strong><br />\nDesde cualquier dispositivo m&oacute;vil o v&iacute;a web. Control&aacute; y ajusta el clima ideal desde donde est&eacute;s.</p>\n\n<p><span style=\"background-color:transparent; color:#333333\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><br />\n<span style=\"background-color:transparent; color:#333333\">- CABA</span><br />\n<span style=\"background-color:transparent; color:#333333\">- ROSARIO</span><br />\n<span style=\"background-color:transparent; color:#333333\">- SAN FRANCISCO (CBA)</span><br />\n<br />\n&nbsp;</p>\n", "03b2fc7fcb", "74430dc081", "", "", "0", "1", "", "33", "", "", "", "a_43a1e7.jpg///a_19b0e0.jpg///a_0566c9.jpg///a_8aeff5.jpg///a_ebb4db.jpg", "0N_9NqufnoY", "", "0000-00-00", "", "", "NEXGEN2250FC"); 
