INSERT INTO `productos` VALUES("67", "2eec7ca0e5", "PROMO EXTRACTOR DE AIRE BAÑO 4 (10 cm)  + PERSIANA MOVIL PROMO", "1120", "0", "10", "<p>- MODELO: Extractor de Ba&ntilde;o 4&quot; (EBG 4&quot;) + Persiana Pl&aacute;stica M&oacute;vil 4&quot;<br />\n<br />\n* EBG 4&quot;<br />\n- Extractor fabricado en material termopl&aacute;stico ABS de formato est&eacute;tico, silencioso y delgado.<br />\n- Dise&ntilde;ado para renovar el aire contaminado o h&uacute;medo de ba&ntilde;os, oficinas y peque&ntilde;as habitaciones.<br />\n- F&aacute;cil instalaci&oacute;n en paredes, techos o vidrio.<br />\n<span style=\"font-size:14px\"><span style=\"background-color:transparent; color:#333333\">- Para ambientes aproximados de 5m2</span><br />\n<span style=\"background-color:transparent; color:#333333\">- Se adapta a conductos y accesorios de 10 cm</span></span><br />\n- Potencia: 25 W<br />\n- Consumo: 0.11 A<br />\n- Extracci&oacute;n:&nbsp;2,5 m3 x min.<br />\n- Nivel sonoro: 52,2 dBA<br />\n- Medidas:&nbsp;159 mm&nbsp;de alto x 159 mm de base x 98 mm di&aacute;metro de conducto.<br />\n<br />\n* PERSIANA PL&Aacute;STICA MOVIL 4&quot;<br />\n- Generalidades: Este accesorio se utiliza para impedir el paso de insectos, polvo u otros elementos o part&iacute;culas del aire, y de la lluvia en el interior del recinto, en el momento en que el ventilador no se encuentra en funcionamiento. Funciona por gravedad, abri&eacute;ndose y cerr&aacute;ndose con el paso del aire durante el funcionamiento del ventilador, y se mantiene cerrada cuando este est&aacute; apagado.<br />\n- Aplicaciones: para colocar en boca de salida de extractor de aire 4&quot; (EBG 4&quot;)<br />\n- Medidas: 15,3 x 15,3 cm<br />\n- Di&aacute;metro boca: 10 cm.</p>\n\n<p>- 1 A&Ntilde;O DE GARANT&Iacute;A</p>\n\n<p>* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):<br />\n- CABA<br />\n- ROSARIO<br />\n- SAN FRANCISCO (CBA)</p>\n", "a45ed48c22", "0d1b59f0bf", "", "", "0", "1", "", "1.5", "", "", "", "a_e2a47b.jpg///a_fbc28d.jpg", "", "", "0000-00-00", "", "", "EBG4+PERS"); 
