n control remoto con display de LCD (Pantalla de Cristal L&iacute;quido) desde el cual se podr&aacute; setear la temperatura deseada y programar el encendido o apagado del equipo. Tambi&eacute;n las funciones de modo turbo, modo sleep, ventilaci&oacute;n, etc.<br />\n<br />\n<strong>REFRIGERANTE ECOL&Oacute;GICO</strong><br />\nA fin de mejorar la eficiencia, y disminuir el impacto ambiental, este equipo cuenta con refrigerante R410A que no da&ntilde;a la capa de ozono contribuyendo a cuidar el medio ambiente.<br />\n<br />\n<strong>ALTA EFICIENCIA</strong><br />\nEste equipo se ubica en la m&aacute;s alta performance de ahorro energ&eacute;tico contribuyendo a la reducci&oacute;n del consumo y un menor impacto ambiental.<br />\n<br />\n<strong>MEMORIA POSICI&Oacute;N LOUVER</strong><br />\nEsta funci&oacute;n es totalmente autom&aacute;tica. Memoriza la &uacute;ltima posici&oacute;n seteada en la paleta direccional de aire del equipo, posibilitando que al encenderlo, comience a funcionar en el &aacute;ngulo anteriormente deseado. En caso de corte de luz o interrupci&oacute;n del funcionamiento de la unidad, el deflector regresar&aacute; al &aacute;ngulo fijado por default en el equipo.<br />\n<br />\n<strong>MODO SLEEP</strong><br />\nLa funci&oacute;n &quot;Sleep&quot; permite que el aire trabaje durante la noche, ajustando gradualmente la temperatura posibilitando el ahorro de energia y el total confort del usuario en el momento de su descanso.<br />\n<br />\n<strong>DETECCI&Oacute;N P&Eacute;RDIDA DE REFRIGERANTE</strong><br />\nMediante un sistema de sensores el equipo es capaz de detectar una p&eacute;rdida de refrigerante en el sistema y lo indica en el display de la unidad interior. Esto facilita la detecci&oacute;n de problemas y evita un funcionamiento deficiente.</p>\n\n<p>&nbsp;</p>\n\n<p>* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 4 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):<br />\n- CABA<br />\n- ROSARIO<br />\n- C&Oacute;RDOBA CAPITAL<br />\n- SAN FRANCISCO (CBA)</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n", "03b2fc7fcb", "67e10f2925", "", "", "0", "1", "", "35", "", "", "", "a_1e061f.jpg///a_700048.jpg///a_c1d74e.jpg///a_9f29b8.jpg///a_54c78c.jpg", "", "", "0000-00-00", "", "", "MIDEALUMINA2750F"); 
INSERT INTO `productos` VALUES("73", "67d651818d", "SPLIT MIDEA BLANC - 5300 Kcal FRIO/CALOR", "24530", "0", "0", "<p>MARCA: MIDEA BLANC&nbsp;5300 Kcal/H &nbsp;FRIO/CALOR&nbsp; (6170 W)</p>\n\n<p>- Modelo: MSBI-22H-01F</p>\n\n<p>- Origen: Argentina</p>\n\n<p><strong>C</strong><strong>ARACTER&Iacute;STICAS DEL EQUIPO</strong></p>\n\n<p>- Consumo: Refrigeraci&oacute;n&nbsp;1.92&nbsp;KW /&nbsp;Calefacci&oacute;n&nbsp;1.99 KW</p>\n\n<p>- Frigor&iacute;as: 5300&nbsp; Kcal</p>\n\n<p>- Eficiencia energ&eacute;tica fr&iacute;o:&nbsp;3.24 EER</p>\n\n<p>- Eficiencia energ&eacute;tica calor: 3.21 EER.</p>\n\n<p>- Dimensiones unidad interior:&nbsp;1038 x 235 x 325 &nbsp;mm</p>\n\n<p>-&nbsp;&nbsp;Dimensiones unidad exterior:&nbsp;845 x 363 x 702 &nbsp;mm</p>\n\n<p>- Eficiencia energ&eacute;tica: Tipo A 3.21 fr&iacute;o/calor</p>\n\n<p>- Dise&ntilde;ado con l&iacute;neas suaves y minimalistas, alta eficiencia energ&eacute;tica y m&iacute;nimo nivel sonoro, garantiza el clima perfecto en todos tus ambientes. Aire acondicionado con innovador Led display de temperatura con encendido opcional.<br />\n<br />\n<strong>CLIMA FAVORITO</strong><br />\nMemoriza tu seteo preferido para mantener tu frescura y confort ideal, en un solo toque.<br />\nDetecci&oacute;n de p&eacute;rdida de Refrigerante<br />\nPara mantener el funcionamiento correcto.<br />\nMediante un sistema de sensores el equipo es capaz de detectar<br />\nuna p&eacute;rdida y lo indica en el display de la unidad interior.<br />\n<br />\n<strong>DISPLAY OCULTO</strong><br />\nDisplay de temperatura con encendido opcional para mayor elegancia.<br />\n<br />\n<strong>DOBLE FILTRADO</strong><br />\nLos filtros duales eliminan las part&iacute;culas del aire, potencialmente da&ntilde;inas para la salud, m&aacute;s limpio.<br />\n<br />\n<strong>EFICIENCIA ENERG&Eacute;TICA A</strong><br />\nEste equipo se ubica en la m&aacute;s alta performance de ahorro energ&eacute;tico contribuyendo a la reducci&oacute;n del consumo y un menor impacto ambiental.<br />\n<br />\n<strong>FUNCI&Oacute;N SUPER COOL</strong><br />\nLa funci&oacute;n &quot;Super Cool&quot; de Midea Blanc se puede activar con un solo toque. Aumenta la velocidad del ventilador para alcanzar el confort deseado.<br />\n<br />\n<strong>DESCANSO IDEAL</strong><br />\nEl modo Sleep regula la temperatura del ambiente de manera inteligente, evitando refrigerar o calefaccionar en exceso ahorrando energ&iacute;a y garantizando un mayor confort durante las horas de sue&ntilde;o.<br />\n<br />\n<strong>FUNCI&Oacute;N TIMER</strong><br />\nFunci&oacute;n de encendido/apagado programable para hora y temperatura deseada.<br />\n<br />\n<strong>MEMORIA DE POSICI&Oacute;N LOUVER</strong><br />\nEsta funci&oacute;n es totalmente autom&aacute;tica. Memoriza la &uacute;ltima posici&oacute;n seteada en la paleta direccional de aire del equipo, posibilitando que al encenderlo, comience a funcionar en el &aacute;ngulo anteriormente deseado. En caso de corte de luz o interrupci&oacute;n del funcionamiento de la unidad, el deflector regresar&aacute; al &aacute;ngulo fijado por default en el equipo.<br />\n<br />\n<strong>Self Clean :Sistema de Auto-limpieza</strong><br />\nDisponible solo para los equipos Frio &ndash; Calor<br />\nLa unidad interior opera en modo ventilacion por unos instantes. Esta funci&oacute;n<br />\nmantiene seca por dentro la unidad interior previniendo que se forme moho.</p>\n\n<p><br />\n<span style=\"background-color:transparent; color:#333333\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><br />\n<span style=\"background-color:transparent; color:#333333\">- CABA</span><br />\n<span style=\"background-color:transparent; color:#333333\">- ROSARIO</span><br />\n<span style=\"background-color:transparent; color:#333333\">- SAN FRANCISCO (CBA)</span><br />\n&nbsp;</p>\n\n<p>&nbsp;</p>\n", "03b2fc7fcb", "67e10f2925", "", "", "0", "1", "", "65", "", "", "", "a_235a49.jpg///a_d863c9.jpg///a_c5aeb0.jpg///a_e0a87d.jpg///a_2d9e34.jpg", "", "", "0000-00-00", "", "", "MIDEABLANC5300FC"); 
