n un control remoto con display de LCD (Pantalla de Cristal L&iacute;quido) desde el cual se podr&aacute; setear la temperatura deseada y programar el encendido o apagado del equipo. Tambi&eacute;n las funciones de modo turbo, modo sleep, ventilaci&oacute;n, etc.<br />\n<br />\n<strong>REFRIGERANTE ECOL&Oacute;GICO</strong><br />\nA fin de mejorar la eficiencia, y disminuir el impacto ambiental, este equipo cuenta con refrigerante R410A que no da&ntilde;a la capa de ozono contribuyendo a cuidar el medio ambiente.<br />\n<br />\n<strong>ALTA EFICIENCIA</strong><br />\nEste equipo se ubica en la m&aacute;s alta performance de ahorro energ&eacute;tico contribuyendo a la reducci&oacute;n del consumo y un menor impacto ambiental.<br />\n<br />\n<strong>MEMORIA POSICI&Oacute;N LOUVER</strong><br />\nEsta funci&oacute;n es totalmente autom&aacute;tica. Memoriza la &uacute;ltima posici&oacute;n seteada en la paleta direccional de aire del equipo, posibilitando que al encenderlo, comience a funcionar en el &aacute;ngulo anteriormente deseado. En caso de corte de luz o interrupci&oacute;n del funcionamiento de la unidad, el deflector regresar&aacute; al &aacute;ngulo fijado por default en el equipo.<br />\n<br />\n<strong>MODO SLEEP</strong><br />\nLa funci&oacute;n &quot;Sleep&quot; permite que el aire trabaje durante la noche, ajustando gradualmente la temperatura posibilitando el ahorro de energia y el total confort del usuario en el momento de su descanso.<br />\n<br />\n<strong>DETECCI&Oacute;N P&Eacute;RDIDA DE REFRIGERANTE</strong><br />\nMediante un sistema de sensores el equipo es capaz de detectar una p&eacute;rdida de refrigerante en el sistema y lo indica en el display de la unidad interior. Esto facilita la detecci&oacute;n de problemas y evita un funcionamiento deficiente.</p>\n\n<p><br />\n<span style=\"background-color:transparent; color:#333333; font-family:&quot;Open Sans&quot;,sans-serif; font-size:14px\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><br />\n<span style=\"background-color:transparent; color:#333333; font-family:&quot;Open Sans&quot;,sans-serif; font-size:14px\">- CABA</span><br />\n<span style=\"background-color:transparent; color:#333333; font-family:&quot;Open Sans&quot;,sans-serif; font-size:14px\">- ROSARIO</span><br />\n<span style=\"background-color:transparent; color:#333333; font-family:&quot;Open Sans&quot;,sans-serif; font-size:14px\">- SAN FRANCISCO (CBA)</span><br />\n&nbsp;</p>\n", "03b2fc7fcb", "67e10f2925", "", "", "0", "1", "", "53", "", "", "", "a_2e3266.jpg///a_872e12.jpg///a_7a5b59.jpg///a_871881.jpg///a_461f3e.jpg", "", "", "0000-00-00", "", "", "MIDEALUMINA4750"); 
INSERT INTO `productos` VALUES("101", "2942eb9314", "SPLIT MIDEA BLANC - 2970 Kcal FRIO CALOR", "13100", "0", "0", "<div>MODELO:&nbsp; MIDEA BLANC 2790 Kcal/H&nbsp; FRIO/CALOR<br />\n- Modelo: MSBC-12-01F<br />\n- Origen: Argentina</div>\n\n<div>&nbsp;</div>\n\n<div>CARACTER&Iacute;STICAS DEL EQUIPO<br />\n- Consumo: Refrigeraci&oacute;n 0.99 KW / Calefacci&oacute;n 0.95 KW<br />\n- Frigor&iacute;as: Refrigeraci&oacute;n 2970 Kcal / Calefacci&oacute;n 2623 Kcal<br />\n- Eficiencia energ&eacute;tica fr&iacute;o: A 3.28 EER<br />\n- Eficiencia energ&eacute;tica calor: C 3.21 COP.<br />\n- Dimensiones unidad interior: 805 X 205 X 285 mm<br />\n-&nbsp; Dimensiones unidad exterior: 770 X 300 X 555&nbsp; mm<br />\n- Dise&ntilde;ado con l&iacute;neas suaves y minimalistas, alta eficiencia energ&eacute;tica y m&iacute;nimo nivel sonoro, garantiza el clima perfecto en todos tus ambientes. Aire acondicionado con innovador Led display de temperatura con encendido opcional.</div>\n\n<div>&nbsp;</div>\n\n<div>CLIMA FAVORITO<br />\nMemoriza tu seteo preferido para mantener tu frescura y confort ideal, en un solo toque.<br />\nDetecci&oacute;n de p&eacute;rdida de Refrigerante<br />\nPara mantener el funcionamiento correcto.<br />\nMediante un sistema de sensores el equipo es capaz de detectar<br />\nuna p&eacute;rdida y lo indica en el display de la unidad interior.</div>\n\n<div>&nbsp;</div>\n\n<div>DISPLAY OCULTO<br />\nDisplay de temperatura con encendido opcional para mayor elegancia.</div>\n\n<div>&nbsp;</div>\n\n<div>DOBLE FILTRADO<br />\nLos filtros duales eliminan las part&iacute;culas del aire, potencialmente da&ntilde;inas para la salud, m&aacute;s limpio.</div>\n\n<div>&nbsp;</div>\n\n<div>EFICIENCIA ENERG&Eacute;TICA A<br />\nEste equipo se ubica en la m&aacute;s alta performance de ahorro energ&eacute;tico contribuyendo a la reducci&oacute;n del consumo y un menor impacto ambiental.</div>\n\n<div>&nbsp;</div>\n\n<div>FUNCI&Oacute;N SUPER COOL<br />\nLa funci&oacute;n &quot;Super Cool&quot; de Midea Blanc se puede activar con un solo toque. Aumenta la velocidad del ventilador para alcanzar el confort deseado.</div>\n\n<div>&nbsp;</div>\n\n<div>DESCANSO IDEAL<br />\nEl modo Sleep regula la temperatura del ambiente de manera inteligente, evitando refrigerar o calefaccionar en exceso ahorrando energ&iacute;a y garantizando un mayor confort durante las horas de sue&ntilde;o.</div>\n\n<div>&nbsp;</div>\n\n<div>FUNCI&Oacute;N TIMER<br />\nFunci&oacute;n de encendido/apagado programable para hora y temperatura deseada.</div>\n\n<div>&nbsp;</div>\n\n<div>MEMORIA DE POSICI&Oacute;N LOUVER<br />\nEsta funci&oacute;n es totalmente autom&aacute;tica. Memoriza la &uacute;ltima posici&oacute;n seteada en la paleta direccional de aire del equipo, posibilitando que al encenderlo, comience a funcionar en el &aacute;ngulo anteriormente deseado. En caso de corte de luz o interrupci&oacute;n del funcionamiento de la unidad, el deflector regresar&aacute; al &aacute;ngulo fijado por default en el equipo.</div>\n\n<div>Self Clean :Sistema de Auto-limpieza<br />\nDisponible solo para los equipos Frio &ndash; Calor<br />\nLa unidad interior opera en modo ventilaci&oacute;n por unos instantes. Esta funci&oacute;n<br />\nmantiene seca por dentro la unidad interior previniendo que se forme moho.</div>\n\n<p><br />\n<span style=\"background-color:transparent; color:#333333\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><br />\n<span style=\"background-color:transparent; color:#333333\">- CABA</span><br />\n<span style=\"background-color:transparent; color:#333333\">- ROSARIO</span><br />\n<span style=\"background-color:transparent; color:#333333\">- SAN FRANCISCO (CBA)</span><br />\n&nbsp;</p>\n", "03b2fc7fcb", "67e10f2925", "", "", "0", "1", "", "40", "", "", "", "a_e8919d.jpg///a_620e5b.jpg///a_0bdedd.jpg///a_92f922.jpg///a_f30abc.jpg", "", "", "0000-00-00", "", "", "MIDEABLANC2970FC"); 
