INSERT INTO `productos` VALUES("122", "4ef20335a5", "PERSIANA MOVIL PLÁSTICA 350 MM", "832", "0", "10", "<div>- MODELO: PERSIANA PL&Aacute;STICA MOVIL 350 MM</div>\n\n<div>GENERALIDADES:<br />\nEste accesorio se utiliza para impedir el paso de insectos, polvo u otros elementos o part&iacute;culas del aire, y de la lluvia en el interior del recinto, en el momento en que el ventilador no se encuentra en funcionamiento. Funciona por gravedad, abri&eacute;ndose y cerr&aacute;ndose con el paso del aire durante el funcionamiento del ventilador, y se mantiene cerrada cuando este est&aacute; apagado.</div>\n\n<div>DETALLES CONSTRUCTIVOS<br />\n- Fabricado en alto impacto con UV para protecci&oacute;n de da&ntilde;os solares<br />\n- Marco cuadrado exterior de 40 x 40&nbsp; cm<br />\n- Marco interior de 36,5 x 36,5 cm<br />\n- Para colocar en extractor/conducto de 35 cm<br />\n- Ideal para conductos en el exterior</div>\n\n<div>&nbsp;</div>\n\n<div>\n<div style=\"-webkit-text-stroke-width:0px; background-color:transparent; box-sizing:border-box; color:#333333\">- 1 A&Ntilde;O DE GARANT&Iacute;A.<br />\n- CONTAMOS CON MAS DE 50 A&Ntilde;OS DE TRAYECTORIA EN EL MERCADO</div>\n\n<div style=\"-webkit-text-stroke-width:0px; background-color:transparent; box-sizing:border-box; color:#333333\">&nbsp;</div>\n\n<div style=\"-webkit-text-stroke-width:0px; background-color:transparent; box-sizing:border-box; color:#333333\">* SOMOS FABRICANTES - TENEMOS TODOS LOS REPUESTOS<br />\n<span style=\"background-color:transparent; color:#333333; font-size:14px\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><br />\n<span style=\"background-color:transparent; color:#333333; font-size:14px\">- CABA</span><br />\n<span style=\"background-color:transparent; color:#333333; font-size:14px\">- ROSARIO</span><br />\n<span style=\"background-color:transparent; color:#333