INSERT INTO `productos` VALUES("152", "695e4f0dfc", "Combo Extractor De Aire Cocina 4\" + Baño 4\"", "4250", "0", "2", "<div><strong>- MODELO: COMBO CAMPANITA 100 + EBG 4&quot;</strong></div>\n\n<div>CAMPANITA 100<br />\n- Dise&ntilde;ado para aplicaciones en extremos de entubaciones de extracci&oacute;n<br />\n- Puede utilizarse como elemento de extracci&oacute;n en campanas de cocina o ba&ntilde;os<br />\n-&nbsp; Alto rendimiento, gran caudal, bajo nivel sonoro<br />\n- Fabricado en pl&aacute;stico de alto impacto<br />\n- Provistos con motores clase B y protecci&oacute;n IP 44<br />\n- Para colocar en final de conducto de 100 mm<br />\n- Debe quedar instalado siempre de forma vertical<br />\n- Para colocar en final de conducto de campana de cocina o en ba&ntilde;os.<br />\n- Construido en pl&aacute;stico de alto impacto<br />\n- Extracci&oacute;n: 300 m3 x hora<br />\n- Potencia: 0,08 PH<br />\n- Medidas: 93 mm de alto x 141 mm de base, 269 mm de di&aacute;metro<br />\n- Puede a&ntilde;adirse control de velocidades como accesorio (Dimmer)</div>\n\n<div>&nbsp;</div>\n\n<div>EXTRACTOR DE BA&Ntilde;O EBG 4&quot;<br />\n- Extractor fabricado en material termopl&aacute;stico ABS de formato est&eacute;tico, silencioso y delgado.<br />\n- Dise&ntilde;ado para renovar el aire contaminado o h&uacute;medo de ba&ntilde;os, oficinas y peque&ntilde;as habitaciones.<br />\n- F&aacute;cil instalaci&oacute;n en paredes, techos, vidrio o cielorazos<br />\n-&nbsp; Motor potenciado con bujes auto lubricados<br />\n- Para ambientes aproximados de 5m2<br />\n- Se adapta a conductos y accesorios de 10 cm<br />\n- Potencia: 25 W<br />\n- Consumo: 0.11 A<br />\n- Extracci&oacute;n: 2,5 m3 x min.<br />\n- Nivel sonoro: 52,2 dBA<br />\n- Medidas: 159 mm de alto x 159 mm de base x 98 mm di&aacute;metro de conducto.</div>\n\n<div>&nbsp;</div>\n\n<div>- 1 A&Ntilde;O DE GARANT&Iacute;A.</div>\n\n<div>\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):<br />\n- CABA<br />\n- ROSARIO<br />\n- SAN FRANCISCO (CBA)</p>\n</div>\n", "a45ed48c22", "81aec204d8", "", "", "0", "1", "", "5", "", "", "", "a_71e77e.jpg///a_acfff8.jpg///a_06c3a0.-min///a_1d977d.jpg///a_d3cd8f.jpg", "", "", "0000-00-00", "", "", "COMBO CAM100+EBG4"); 
