INSERT INTO `productos` VALUES("167", "9f021f347c", "EXTRACTOR DE AIRE INDUSTRIAL 65 CM TRIFÁSICO PARA PARED", "14705", "0", "1", "<p><span style=\"font-size:14px\"><span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- MODELO: KRM 650/4 P TRIF&Aacute;SICO </span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Extractor de aire axial industrial de 65 cm</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Di&aacute;metro interno: 64 cm</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Di&aacute;metro externo: 76.5 cm</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Profundidad total: 70.5 cm</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Aplicaciones industriales y aspiraci&oacute;n de campana de cocina industriales</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Pueden trabajar vertical u horizontalmente</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- H&eacute;lices: en P (polipropileno y fibra de vidrio) de &aacute;ngulo variable, de alto rendimiento. 8 aspas</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Aros: Aro R de 1 pesta&ntilde;a para pared. Repujados en chapa de acero.</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Motor: industrial blindado monof&aacute;sico</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Caudal m&aacute;ximo: 14.000 m3 x hora </span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Potencia: 1.5 HP</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- RPM: 1400</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Dise&ntilde;ado para uso continuo</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Puede agregarse como accesorio un DIMMER (regulador de velocidad) que reduce un 50% el rendimiento del equipo y Persiana m&oacute;vil o fija </span><br />\n<br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- 1 A&Ntilde;O DE GARANT&Igrave;A</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">* SOMOS FABRICANTES - TENEMOS TODOS LOS REPUESTO</span><br />\n<br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\"