 />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Potencia:650 Watts</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Preparado para el uso continuo del equipo</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Aplicaci&oacute;n netamente INDUSTRIAL</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Ventilador VERDADERAMENTE INDUSTRIAL, NADA SIMILAR EN EL MERCADO. </span></span><br />\n&nbsp;</p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"font-size:14px\"><span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif; font-size:14px\">- 1 A&Ntilde;O DE GARANT&Igrave;A</span><br />\n<span style=\"background-color:transparent; color:#666666; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif; font-size:14px\">- TODOS LOS REPUESTOS</span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"background-color:transparent; color:#333333; font-size:14px\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 4 SUCURSALES - ( SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O ):</span><br />\n<span style=\"background-color:transparent; color:#333333; font-size:14px\">- CABA</span><br />\n<span style=\"background-color:transparent; color:#333333; font-size:14px\">- ROSARIO</span><br />\n<span style=\"background-color:transparent; color:#333333; font-size:14px\">- C&Oacute;RDOBA CAPITAL</span><br />\n<