INSERT INTO `productos` VALUES("174", "548ac35e04", "Alquiler De Ventiladores De Pie 29 Para Eventos / Fiestas ", "0", "0", "100", "<h3 style=\"color:#333333; font-style:normal; margin-left:0px; margin-right:0px; text-align:left\"><span style=\"font-size:14px\"><strong>Incluye</strong></span></h3>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"font-size:14px\">1) Ventiladores de pie de 25&quot; para eventos / fiestas<br />\n2) Ofrecemos el env&iacute;o gratuito a cualquiera de nuestras 3 sucursales:<br />\n- CABA (San Telmo - Independencia 998)<br />\n- ROSARIO (Centro)<br />\n- SAN FRANCISCO (C&oacute;rdoba)<br />\n3) El precio es x UNIDAD e incluye IVA</span></p>\n\n<h3 style=\"color:#333333; font-style:normal; margin-left:0px; margin-right:0px; text-align:left\"><strong><span style=\"font-size:14px\">No incluye</span></strong></h3>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"font-size:14px\">1) GATTI S.A no se hace responsable de la entrega o el retiro de los equipos ni del costo que implique el env&iacute;o de los mismos. Esto corre por cuenta de la empresa/persona que lo contrata. Los ventiladores pueden retirarse en Casa Central o en alguna de las sucursales de la firma o bien puede coordinar el env&iacute;o con el cliente.</span></p>\n\n<h3 style=\"color:#333333; font-style:normal; margin-left:0px; margin-right:0px; text-align:left\"><strong><span style=\"font-size:14px\">M&aacute;s informaci&oacute;n</span></strong></h3>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"font-size:14px\">- La cancelaci&oacute;n de la reserva de la reserva por parte del cliente supondr&aacute;, si se efect&uacute;a con:<br />\n? Menos de 15 d&iacute;as de antelaci&oacute;n: se perder&aacute; la totalidad del dep&oacute;sito de reserva.<br />\n? Asimismo, el impago de las cantidades pactadas en los plazos previstos en las condiciones de pago dar&aacute; lugar a la resoluci&oacute;n contractual y a la p&eacute;rdida del importe abonado hasta aquel momento.<br />\n- Cualquier da&ntilde;o causado a los equipos se repercutir&aacute; al cliente-arrendatario, quien asume directamente aquellos que sean originados por terceros contratados por &eacute;l o subcontratados por colaboradores suyos.<br />\n- Se deber&aacute; depositar un 25% extra por posibles da&ntilde;os que se le pueda ocasionar a los equipos. Una vez devueltos los mismos y constatado que no poseen da&ntilde;os, dicho importe ser&aacute; devuelto.<br />\n- Los equipos deben ser devueltos en la misma condici&oacute;n con los que fueron entregados y dentro de los 48 Hs posteriores a la finalizaci&oacute;n del evento.<br />\n- Se debe firmar contrato con condiciones de alquiler.</span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"font-size:medium\">* Ver condiciones de alquiler en &quot;manual pdf&quot;&nbsp;</span></p>\n", "7b90340746", "39cf6773f4", "", "", "0", "0", "", "0", "", "", "", "a_63370f.jpg", "", "", "0000-00-00", "", "", "ALQUILER FABY 29"); 
