INSERT INTO `productos` VALUES("180", "839d6e7f10", "EXTRACTOR CENTURY - VENTS ", "0", "0", "100", "<p>GENERALIDAD</p>\n\n<p>Ventilador Axial para montar en pared . En el dise&ntilde;o del mismo se ha procurado la construcci&oacute;n&nbsp; de una unidad s&oacute;lida, compacta y chata. De gran caudal y bajas presiones, para trabajar en un rango de temperaturas que oscila entre 0&ordm;C y 40&ordm;C. Esta l&igrave;nea comercial permite un uso continuo del equipo-</p>\n\n<p>APLICACIONES</p>\n\n<p>Se trata de un equipo apto para servicios continuos en condiciones exigentes. Aplicados en locales comerciales, auditorios grandes, entre otros.</p>\n\n<p>* DISTRIBUIDORES OFICIALES DE VENTS EN ARGENTINA&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n", "61e82f4be2", "917986bc66", "", "", "0", "0", "", "0", "", "", "", "a_6bf968.png///a_bfc7a2.jpg///a_8f31c7.png", "", "", "0000-00-00", "", "", "CENTURY OV1"); 
INSERT INTO `productos` VALUES("181", "36f1978573", "EXTRACTOR DE AIRE BAÑO - VENTS ", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Dise&ntilde;ado para renovar el aire contaminado o h&uacute;medo en peque&ntilde;as habitaciones, ba&ntilde;os, cocinas y locales.</p>\n\n<p>APLICACIONES</p>\n\n<p>&bull; El ventilador va montado directamente sobre el conducto de ventilaci&oacute;n.<br />\n&bull; Se recomienda la aplicaci&oacute;n de conductos exibles en caso de ubicaci&oacute;n remota del conducto de ventilaci&oacute;n. El conducto de aire est&aacute; conectado a la brida de escape del ventilador a trav&eacute;s de una abrazadera.<br />\n&bull; Se ja a la pared a traves de tornillos<br />\n&bull; Puede montarse en techos y cielorazos.</p>\n\n<p><span style=\"background-color:transparent; color:#333333; font-family:sans-serif,Arial,Verdana,\">* DISTRIBUIDORES OFICIALES DE VENTS EN ARGENTINA&nbsp;</span></p>\n", "61e82f4be2", "917986bc66", "", "", "0", "0", "", "0", "", "", "", "a_787172.png///a_f03b79.jpg///a_4536cb.png", "", "", "0000-00-00", "", "", "EBG VENTS "); 
INSERT INTO `productos` VALUES("182", "c83b5d3f91", "TUBULAR UK - VENTS ", "0", "0", "100", "<p>GENERALIDADES</p>\n\n<p>Los ventiladores VK se aplican a los sistemas de ventilaci&oacute;n de suministro y extracci&oacute;n de locales comerciales, de ocinas y otros. Compatibles con conductos de aire de 100, 150 y 250 mm. Estos modelos son fabricados con motores de bajo ruido. Debido a su carcasa de pl&aacute;stico duradero, resiste a la corrosi&oacute;n y son una excelente opci&oacute;n para colocar en sistemas de ventilaci&oacute;n donde hay grandes niveles de humedad como ba&ntilde;os, cocinas, etc.</p>\n\n<p>DETALLES CONSTRUCTIVOS</p>\n\n<p>Carcasa: la carcasa esta constru&iacute;da con pl&aacute;stico resistente de primera calidad. Los ventiladores estan equipados con cajas terminales a prueba de agua.</p>\n\n<p>Motor: El impulsor centr&iacute;fugo con palas curvadas hacia atr&aacute;s es impulsado por un motor de rotor externo. El motor esta equipado con una protecci&oacute;n de sobrecalentamiento de auto-reinicio. El motor est&aacute; equipado con rodamientos para una larga vida &uacute;til dise&ntilde;ada para al menos 40000 horas de funcionamiento. Para un funcionamiento preciso, uso correcto y bajo nivel sonoro, cada impulsor se equilibra din&aacute;micamente durante el montaje. El &iacute;ndice de protecci&oacute;n del motor es IP 44.</p>\n\n<p>Control de velocidad: Varios equipos pueden ser conectado a un controlador de velocidad siempre que la potencia total y la corriente de operaci&oacute;n no excedan los par&aacute;metros del controlador de velocidad nominal. Los modelos de dos velocidades se controlan con el interruptor de velocidad externo P2-10<br />\n(disponible por separado).</p>\n\n<p><span style=\"background-color:transparent; color:#333333; font-family:&quot;Open Sans&quot;,sans-serif; font-size:14px\">* DISTRIBUIDORES OFICIALES DE VENTS EN ARGENTINA</span></p>\n\n<p>&nbsp;Montaje: El ventilador puede ser montado sobre la pared o el techo con m&eacute;nsulas de soporte en cualquier &aacute;ngulo. La conexi&oacute;n e instalaci&oacute;n el&eacute;ctrica se realizar&aacute; de acuerdo con el manual y el diagrama de cableado en la caja de terminales.</p>\n\n<p>&nbsp;</p>\n", "61e82f4be2", "917986bc66", "", "", "0", "0", "", "0", "", "", "", "a_a4dec0.png///a_eb5f0c.png///a_cb8061.jpg///a_9163bc.png", "", "", "0000-00-00", "", "", "TUBULAR VENTS "); 
