elvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Para ambientes aproximados de 12m2</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Se adapta a conductos y accesorios de 15 cm</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Se fi&shy;ja a la pared a trav&eacute;s de tornillos</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Puede montarse en techos y cielorrasos.</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Incluye los tornillos para colocarlo</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Potencia: 20 W</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Extracci&oacute;n: 6 m3 x min.</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Consumo: 0,14 A</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Nivel sonoro: 33 dBA</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Peso: 0.850 Kgs</span><br />\n<span style=\"background-color:transparent; font-family:Proxima Nova,-apple-system,Helvetica Neue,Helvetica,Roboto,Arial,sans-serif\">- Medidas: 205 mm de alto x 205 mm de base x 150 mm di&aacute;metro del conducto.</span></span></p>\n\n<p style=\"margin-left:0px;