INSERT INTO `productos` VALUES("196", "5bd25f29a0", "Extractor De Baño 4 (10 Cm) Vents + Persiana 4\" ", "1150", "0", "2", "<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><em><strong><span style=\"background-color:transparent\">MODELO: VENTS 100 S</span></strong></em><br />\n<span style=\"background-color:transparent\">- La carcasa y la h&eacute;lice est&aacute;n construidas en pl&aacute;stico de alta calidad, resistente a los rayos UV. Silencioso y delgado.</span><br />\n<span style=\"background-color:transparent\">- Dise&ntilde;ado para renovar el aire contaminado o h&uacute;medo de ba&ntilde;os, oficinas y peque&ntilde;as habitaciones.</span><br />\n<span style=\"background-color:transparent\">- F&aacute;cil instalaci&oacute;n en paredes, techos, vidrio o cielorrasos.</span><br />\n<span style=\"background-color:transparent\">- Rejilla protectora contra insectos</span><br />\n<span style=\"background-color:transparent\">- Protecci&oacute;n IP 34.</span><br />\n<span style=\"background-color:transparent\">- Dise&ntilde;ado para un funcionamiento continuo y no requiere mantenimiento.</span><br />\n<span style=\"background-color:transparent\">- Motor potenciado con bujes auto lubricados</span><br />\n<span style=\"background-color:transparent\">- Para ambientes aproximados de 5m2</span><br />\n<span style=\"background-color:transparent\">- Se adapta a conductos y accesorios de 10 cm</span><br />\n<span style=\"background-color:transparent\">- Se fi&shy;ja a la pared a trav&eacute;s de tornillos</span><br />\n<span style=\"background-color:transparent\">- Puede montarse en techos y cielorrasos.</span><br />\n<span style=\"background-color:transparent\">- Incluye los tornillos para colocarlo</span><br />\n<span style=\"background-color:transparent\">- Potencia: 7 W</span><br />\n<span style=\"background-color:transparent\">- Extracci&oacute;n: 2.5 m3 x min.</span><br />\n<span style=\"background-color:transparent\">- Consumo: 0,0035 A</span><br />\n<span style=\"background-color:transparent\">- Nivel sonoro: 26 dBA</span><br />\n<span style=\"background-color:transparent\">- Peso: 0.520 Kgs</span><br />\n<span style=\"background-color:transparent\">- Medidas: 150 mm de alto x 150 mm de base x 110 mm di&aacute;metro del conducto.</span><br />\n<br />\n<em><strong><span style=\"background-color:transparent\">MODELO: PERSIANA DE PL&Aacute;STICO 4&quot; / 10 cm</span></strong></em><br />\n<span style=\"background-color:transparent\">- Generalidades: Este accesorio se utiliza para impedir el paso de insectos, polvo u otros elementos o part&iacute;culas del aire, y de la lluvia en el interior del recinto, en el momento en que el ventilador no se encuentra en funcionamiento. Funciona por gravedad, abri&eacute;ndose y cerr&aacute;ndose con el paso del aire durante el funcionamiento del ventilador, y se mantiene cerrada cuando este est&aacute; apagado.</span><br />\n<span style=\"background-color:transparent\">- Aplicaciones: para colocar en boca de salida de extractor de aire 4&quot; (EBG 4&quot;) / 10 cm</span><br />\n<span style=\"background-color:transparent\">- Medidas: 15,3 x 15,3 cm</span><br />\n<span style=\"background-color:transparent\">- Di&aacute;metro boca: 10 cm.</span></span></span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"color:#000000\"><span style=\"font-size:14px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:transparent\">- 1 A&Ntilde;O DE GARANT&Iacute;A</span></span></span></span></p>\n\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\"><span style=\"color:#000000\"><span style=\"font-size:14px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:transparent\">* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES (SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O): CABA / ROSARIO / SAN FRANCISCO&nbsp;</span></span></span></span></p>\n", "a45ed48c22", "0d1b59f0bf", "", "", "0", "1", "", "1", "", "", "", "a_5eed28.jpg///a_bb17d6.png///a_279d1d.jpg///a_066187.jpg///a_c274dc.jpg", "", "", "0000-00-00", "", "", "VENTS 100 + PERSIANA "); 
