INSERT INTO `productos` VALUES("198", "9a47d49146", "VENTILADOR CENTRÍFUGO VCU 2E 140 X 60", "9700", "0", "2", "<p><em><strong>MODELO: VENTILADOR CENTRIFUGO VCU 2E 140 X 60&nbsp;</strong></em><br />\n-&nbsp;Dise&ntilde;ado para el suministro y ventilaci&oacute;n de escape de varios locales. El ventilador se puede utilizar como un componente para los sistemas de ventilaci&oacute;n y aire acondicionado y es adecuado para el montaje exterior.<br />\n-&nbsp;<em>Motor:</em> adoptado por motor de rotor externo as&iacute;ncrono de una sola frase.<br />\n-&nbsp;<em>Rotor: </em>el impulsor con curva hacia atr&aacute;s se combina bien con la carcasa de metal para maximizar el ujo de aire y la eciencia, y para minimizar el nivel de ruido<br />\n-&nbsp;<em>Carcasa de metal:</em> acero de laminaci&oacute;n en fr&iacute;o de estiramiento profundo de calidad. La supercie pintada por pulverizaci&oacute;n tiene una fuerte resistencia a la oxidaci&oacute;n.<br />\n-&nbsp;<em>Caja de alimentaci&oacute;n:</em> de metal. Calidad a prueba de fuego, seguridad para el uso. Y f&aacute;cil de desmontar.<br />\n-&nbsp;Es ampliamente utilizado en hoteles, auditorios, estaciones, supermercados, aeropuertos y otras ocasiones p&uacute;blicas.<br />\n-&nbsp;<em>Montaje:</em> el ventilador es adecuado para su instalaci&oacute;n en ventilaci&oacute;n. C&aacute;maras, unidades de aire acondicionado o pueden ser utilizadas individualmente.<br />\n- Voltaje: 230 V<br />\n- Corriente: 0,64 A<br />\n- Caudal m&aacute;ximo de aire: 515 M3 x H.<br />\n- RPM: 2820<br />\n- Potencia: 148&nbsp;W<br />\n- Nivel sonoro: 68 dBA<br />\n- Peso: 3,700 Kgs</p>\n\n<p>- 1 A&Ntilde;O DE GARANT&Iacute;A</p>\n\n<p>* ENV&Iacute;O GRATIS A CUALQUIERA DE NUESTRAS 3 SUCURSALES (SELECCIONAS LA OPCI&Oacute;N AL MOMENTO DE ELEGIR EL M&Eacute;TODO DE ENV&Iacute;O): CABA / ROSARIO / SAN FRANCISCO&nbsp;</p>\n", "a45ed48c22", "0d1b59f0bf", "", "", "0", "1", "", "3.5", "", "", "", "a_013589.png///a_d48a35.07", 